(331, 'widget_black-studio-tinymce', 'a:15:{i:2;a:4:{s:5:"title";s:0:"";s:4:"text";s:287:"<a href="tel:3106720139"><div class="contact-icon"><img class="alignnone size-full wp-image-86" src="http://rockerbrosmeat.com/wp-content/uploads/2015/10/icon-phone.png" alt="icon-phone" width="126" height="126" /></div>\r\n<div class="contact-info"><strong>310-672-0139</strong></div></a>";s:4:"type";s:4:"html";s:6:"filter";s:1:"0";}i:4;a:4:{s:5:"title";s:0:"";s:4:"text";s:586:"<a href="https://www.google.com/maps/place/Rocker+Brothers+Meat+%26+Prvsn/@33.9714613,-118.3487654,17z/data=!4m6!1m3!3m2!1s0x80c2b7085c231c2d:0x221d9398f12cd9b0!2sRocker+Brothers+Meat+%26+Prvsn!3m1!1s0x80c2b7085c231c2d:0x221d9398f12cd9b0"><div class="contact-icon"><img class="alignnone size-full wp-image-86" src="http://rockerbrosmeat.com/wp-content/uploads/2015/10/icon-location.png" alt="icon-location" width="126" height="126" /></div>\r\n<div class="contact-info"><strong>Rocker Bros. Meat &amp; Provisions, Inc.</strong><br>\r\n405 Centinela Avenue<br>\r\nInglewood, CA 90302</div></a>";s:4:"type";s:4:"html";s:6:"filter";s:1:"0";}i:5;a:4:{s:5:"title";s:0:"";s:4:"text";s:314:"<a href="mailto:info@rockerbrosmeat.com"><div class="contact-icon"><img class="alignnone size-full wp-image-86" src="http://rockerbrosmeat.com/wp-content/uploads/2015/10/icon-email.png" alt="icon-email" width="126" height="126" /></div>\r\n<div class="contact-info"><strong>info@rockerbrosmeat.com</strong></div></a>";s:4:"type";s:4:"html";s:6:"filter";s:1:"0";}i:6;a:4:{s:5:"title";s:4:"Beef";s:4:"text";s:333:"<a href="//rockerbrosmeat.com/products/beef/"><img class="alignnone wp-image-206 size-medium" src="//rockerbrosmeat.com/wp-content/uploads/2016/01/beef-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nRocker Brothers prides itself on sourcing the highest quality, safest, and finest tasting beef from the Mid West and Colorado.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:7;a:4:{s:5:"title";s:4:"Pork";s:4:"text";s:335:"<a href="//rockerbrosmeat.com/products/pork/"><img class="alignnone wp-image-210 size-medium" src="//rockerbrosmeat.com/wp-content/uploads/2016/01/pork-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nWe have programs that offer both commodity and locally raised meats. We offer anti-biotic free, single breed, and Heritage pork.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:8;a:4:{s:5:"title";s:4:"Lamb";s:4:"text";s:319:"<a href="//rockerbrosmeat.com/products/lamb/"><img class="alignnone wp-image-209 size-medium" src="//rockerbrosmeat.com/wp-content/uploads/2016/01/lamb-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nOur lamb is sourced from the best farms across the world. We offer lamb from the US, Australia, and New Zealand.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:9;a:4:{s:5:"title";s:4:"Veal";s:4:"text";s:336:"<a href="http://rockerbrosmeat.com/products/veal/"><img class="alignnone wp-image-223 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/veal-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nWe provide both formula and free-range veal. Our veal is never restrained or tethered and is group raised in Wisconsin.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:10;a:4:{s:5:"title";s:7:"Poultry";s:4:"text";s:370:"<a href="//rockerbrosmeat.com/products/poultry/"><img class="alignnone wp-image-211 size-medium" src="//rockerbrosmeat.com/wp-content/uploads/2016/01/poultry-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nWe stock a wide variety of poultry; supplying natural, free-range, organic, and non-GMO raised poultry. Please contact your salesperson for more information.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:11;a:4:{s:5:"title";s:11:"Smoked Meat";s:4:"text";s:414:"<a href="//rockerbrosmeat.com/products/smoked-meat/"><img class="alignnone wp-image-207 size-medium" src="//rockerbrosmeat.com/wp-content/uploads/2016/01/cured-smoked-meat-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nRocker Brothers has a huge offering of smoked meats to match any need from bacon to charcuterie. We stock both domestic and imported. Please contact your salesperson for more information.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:12;a:4:{s:5:"title";s:12:"Exotic Meats";s:4:"text";s:464:"<a href="//rockerbrosmeat.com/products/exotic-meats/"><img class="alignnone wp-image-208 size-medium" src="//rockerbrosmeat.com/wp-content/uploads/2016/01/exotic-wild-game-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nThe current market for exotic meats and wild game continues to grow. At Rocker Brothers we are right there with it. These proteins come from California, as well as from far off lands. Please contact your salesperson for more information.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:13;a:4:{s:5:"title";s:22:"Green, Healthy, Humane";s:4:"text";s:484:"<a href="http://rockerbrosmeat.com/products/green-healthy-humane/"><img class="alignnone wp-image-247 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/green-healthy-human-300x200.jpg" alt="" width="300" height="200" /></a>\r\n\r\nWe have made a conscious effort to bring animal welfare to the forefront of what we do here at Rocker Brothers. We continually look to make strides in transforming our company into an industry leader in being green, healthy, and humane.";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:14;a:4:{s:5:"title";s:8:"About Us";s:4:"text";s:339:"<a href="http://rockerbrosmeat.com/about-us/"><img class="alignnone wp-image-170 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2015/10/1-300x200.jpg" alt="t-bone steak cooking on an open flame grill" width="300" height="200" /></a>\r\n<a href="http://rockerbrosmeat.com/about-us/" class="btn btn-block">Learn More &rarr;</a>";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:15;a:4:{s:5:"title";s:10:"Deliveries";s:4:"text";s:322:"<a href="http://rockerbrosmeat.com/deliveries/"><img class="alignnone size-medium wp-image-168" src="http://rockerbrosmeat.com/wp-content/uploads/2015/10/trucks-300x200-1454104815.jpg" alt="trucks" width="300" height="200" /></a>\r\n<a href="http://rockerbrosmeat.com/deliveries/" class="btn btn-block">Learn More &rarr;</a>";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}i:16;a:4:{s:5:"title";s:13:"Photo Gallery";s:4:"text";s:315:"<a href="http://rockerbrosmeat.com/photo-gallery/"><img class="alignnone size-medium wp-image-171" src="http://rockerbrosmeat.com/wp-content/uploads/2015/10/3-300x200.jpg" alt="3" width="300" height="200" /></a>\r\n<a href="http://rockerbrosmeat.com/photo-gallery/" class="btn btn-block">View Photo Gallery &rarr;</a>";s:4:"type";s:4:"html";s:6:"filter";s:1:"1";}s:12:"_multiwidget";i:1;}', 'yes'),
