(7, 1, '2015-10-02 10:48:43', '2015-10-02 17:48:43', '<h2>Our History</h2>\r\nRocker Bros. Meats &amp; Provisions, Inc. is a family operated business with a combined 100-years-plus of meat buying, processing, and distributing experience. Our father started Holiday Meat &amp; Provisions in 1965 and the torch has now been passed to Shelly and David, who operate Rocker Bros. Meat &amp; Provisions with the same old-fashioned values, plus a whole new set of working dynamics for higher quality, greater efficiency and better customer satisfaction.\r\n\r\n<strong>Customer Satisfaction is goal number 1:</strong>\r\n\r\nIt is our job, and our goal, to provide chefs with meat products that make their dishes delicious and profitable. We consider ourselves partners with our restaurant owners and chefs. We are the personal, custom butcher shop that every cooking professional needs. We provide cut and cooking suggestions, professional yield testing, premium buying services, and customized processing, like dry aging, trimming and portioning specific to our chef’s wishes.\r\n\r\nOur Midwest suppliers provide us with the finest USDA primal cuts, which we age and process to your exact specifications. We operate under USDA Establishment 1160 and follow strict USDA HACCP regulations. We feature a full line of all meat products, including beef, pork, lamb, veal, poultry, and fresh seafood.\r\n\r\nWe are proud of our high-quality product lines and exclusive relationships with companies such as Sonoma Direct for whom we distribute pasture-raised lamb, pork and other delicious meats that are raised on sustainable family farms.\r\n\r\nAt Rocker Bros, our specialty is portion control. Our butchers are the finest in the meat industry, and some of them have been with us for over 30 years. Their cutting is precise, and we are regularly creating, with our chefs, cuts uniquely designed for their menus. Kobe-style steaks, bone-in filets, beef and lamb short rib osso-buco (Volcano), prime, dry aged cross-cut new york steaks, and prime rib eye medallions, are a few examples.\r\n\r\nWe work really hard to supply our customers with the highest quality meat products at the most affordable prices. Our customers are pleasantly surprised when they realize that often they can buy USDA Prime beef at USDA Choice beef prices.\r\n\r\nWe will come to you and design a program that will enhance your menu with new, innovative products, and prices that will make you (and your customers) very happy. And we invite you to come and take a tour of Rocker Bros unique " boutique" meat environment. Walk through the dry age room, discover and sample new items, and let us customize a meat program just for you.\r\n\r\n<hr />\r\n\r\n<h3>Sheldon Rocker</h3>\r\nProprietor\r\n\r\n<a class="btn" href="//rockerbrosmeat.com/about-us/sheldon-rocker/">Full Bio →</a>', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2016-02-01 08:50:12', '2016-02-01 16:50:12', '', 0, 'http://rockerbrosmeat.com/?page_id=7', 5, 'page', '', 0),
