new york steaks, and prime rib eye medallions, are a few examples.\r\n\r\nWe work really hard to supply our customers with the highest quality meat products at the most affordable prices. Our customers are pleasantly surprised when they realize that often they can buy USDA Prime beef at USDA Choice beef prices.\r\n\r\nWe will come to you and design a program that will enhance your menu with new, innovative products, and prices that will make you (and your customers) very happy. And we invite you to come and take a tour of Rocker Bros unique " boutique" meat environment. Walk through the dry age room, discover and sample new items, and let us customize a meat program just for you.', 'About Us', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2015-10-02 10:48:43', '2015-10-02 17:48:43', '', 7, 'http://rockerbrosmeat.com/2015/10/02/7-revision-v1/', 0, 'revision', '', 0),
(11, 1, '2015-10-02 10:51:06', '2015-10-02 17:51:06', '<h2>Rocker Bros Delivers..</h2>\r\nYour meats are delivered in refrigerated vans six days a week. Saturday deliveries are no extra charge, and though we have no minimum delivery fee, we do ask that our customers consider the environment when ordering - fewer deliveries means less waste, greater efficiency, and savings to all.', 'Deliveries', '', 'publish', 'closed', 'closed', '', 'deliveries', '', '', '2016-02-01 08:18:03', '2016-02-01 16:18:03', '', 0, 'http://rockerbrosmeat.com/?page_id=11', 10, 'page', '', 0),
