(13, 1, '2015-10-02 10:51:06', '2015-10-02 17:51:06', '<h1>Deliveries</h1>\r\n<h2>Rocker Bros Delivers - Think Outside The Box</h2>\r\nRocker Bros offers a BOX-FREE delivery option. This delivery experiment was originally a joint effort between The HOUSTON’S Restaurant chain (a very environmentally conscious organization) and ROCKER BROS in early 2010.\r\n\r\nROCKER BROS, the only meat company offering BOX FREE deliveries, now offers BOX FREE meat deliveries, in our USDA approved reusable plastic totes, to all of our customers.\r\n\r\nOf course, any cardboard delivery boxes we use are made from recycled paper products.\r\n<h2>Rocker Bros Delivers..</h2>\r\nYour meats are delivered in refrigerated vans six days a week. Saturday deliveries are no extra charge, and though we have no minimum delivery fee, we do ask that our customers consider the environment when ordering - fewer deliveries means less waste, greater efficiency, and savings to all.', 'Deliveries', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2015-10-02 10:51:06', '2015-10-02 17:51:06', '', 11, 'http://rockerbrosmeat.com/2015/10/02/11-revision-v1/', 0, 'revision', '', 0),
