(20, 1, '2015-10-02 10:53:51', '2015-10-02 17:53:51', 'Quality Control refers to a broad program that processors employ to ultimately assure consumers of a safe product. Rocker Bros. emphasizes on Quality Control throughout processing. We realize the only way for this to work efficiently is by enforcing all guidelines of HACCP (Hazard Analysis Critical Control Points).\r\n\r\nHACCP is the top priority of the USDA Food Safety and Inspection program (FSIS). Our plant operates under USDA Establishment 1160 and follows strict USDA HACCP regulations. Our Quality Control is directed by David Rocker, co-owner of the company.  David carefully inspects production prior to packaging, to certify quality and accuracy.\r\n\r\n<hr>\r\n\r\n<h2>Product is:</h2>\r\n<ul>\r\n	<li>Hand selected  for each customer</li>\r\n	<li>Portioned and packaged according to specification</li>\r\n	<li>Inspected for accuracy</li>\r\n	<li>Guaranteed for wholesomeness</li>\r\n</ul>', 'Standards of Excellence', '', 'publish', 'closed', 'closed', '', 'standards-of-excellence', '', '', '2016-02-01 08:21:32', '2016-02-01 16:21:32', '', 0, 'http://rockerbrosmeat.com/?page_id=20', 25, 'page', '', 0),
