(35, 1, '2015-10-02 11:08:52', '2015-10-02 18:08:52', '<strong>Superior Farms Lamb:</strong> One of our fine lamb suppliers, Superior provides us with well-known, fine tasting, Colorado Lamb and we make this available to you in primal cuts or by whole animal.\r\n\r\n<strong>Superior Pure –</strong> Lamb raised by Superior Farms on their Superior Pure program are all raised naturally, on family farms in America. This lamb is also available in cuts or by whole animal.\r\n\r\n<strong>Australian –</strong> we offer Australian lamb products, which come in various sizes, including large 28 up lamb racks. Our Australian product is well priced, and delivered cap off, ready to cut and serve.\r\n\r\n<strong>New Zealand –</strong> We keep a variety of sizes of New Zealand lamb in stock, from 10 – 12 oz to 24 oz and up. Lamb from New Zealand is quite nice and extremely well priced.\r\n\r\n<a href="http://superiorfarms.com/"><img class="alignnone wp-image-237 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/superior-farms-logo-200x200.png" alt="superior-farms-logo" width="200" height="200" /></a>', 'Lamb', '', 'publish', 'closed', 'closed', '', 'lamb', '', '', '2016-02-02 13:25:26', '2016-02-02 21:25:26', '', 14, 'http://rockerbrosmeat.com/?page_id=35', 0, 'page', '', 0),
