(37, 1, '2015-10-02 11:09:07', '2015-10-02 18:09:07', 'Our primary veal supplier is Provimi Veal.\r\n\r\n<strong>Provimi Wisconsin</strong> raised veal is available as a purely milk-fed (white) meat or free range (pink in color), natural veal, which is both milk fed and pasture raised.', 'Veal', '', 'publish', 'closed', 'closed', '', 'veal', '', '', '2016-02-01 12:34:18', '2016-02-01 20:34:18', '', 14, 'http://rockerbrosmeat.com/?page_id=37', 0, 'page', '', 0),
