(43, 1, '2015-10-02 11:10:46', '2015-10-02 18:10:46', 'Please <a href="http://rockerbrosmeat.com/contact-us/">contact us</a> if you would like information about our Exotic Meat selection.\r\n\r\nWe offer exotic poultry and game fowl: quail, Cornish game hens, rabbit, squab, pheasant, duck, guinea fowl and more.\r\n\r\nIf you are looking for game meats: wild boar, buffalo, venison, elk, or rabbit, we have a variety of providers and can deliver to you fresh or frozen.', 'Exotic Meats', '', 'publish', 'closed', 'closed', '', 'exotic-meats', '', '', '2016-02-01 08:29:05', '2016-02-01 16:29:05', '', 14, 'http://rockerbrosmeat.com/?page_id=43', 0, 'page', '', 0),
