(52, 1, '2015-10-02 11:21:19', '2015-10-02 18:21:19', '<h1>Beef Cuts</h1>\r\n<h3><strong>Beef - Individual Cuts</strong></h3>\r\nAt Rocker Bros. Meat &amp; Provisions, Inc., we firmly believe the best way to build our business is to help you build yours. That\'s why we\'re committed to delivering more than just beef in a box. That\'s also why our Total Program provides the products and services you expect and demand. All cuts can be purchased either whole or portion.\r\n\r\nBelow is a list of Beef Cuts we carry broken down into individual categories for easy browsing.\r\n<h3><strong>Chuck</strong></h3>\r\n<ol>\r\n	<li>Shoulder Clod- Flat Iron Steak</li>\r\n	<li>Square Cut Chuck - Chuck Flap</li>\r\n	<li>Chuck Roll- Chuck Roll Neck-off</li>\r\n	<li>Chuck Tender</li>\r\n	<li>Chuck Eye</li>\r\n</ol>\r\n<h3><strong>Rib</strong></h3>\r\n<ol>\r\n	<li>107 RIb</li>\r\n	<li>109 RIb</li>\r\n	<li>Export Rib - Bone-in Prime Rib- Bone-in Ribeye steak</li>\r\n	<li>Lip-on Ribeye- Prime Rib- Ribeye Roll (lip-off)- Ribeye Steak</li>\r\n	<li>Blade Meat</li>\r\n	<li>Short Ribs- Bone-in Short Rib (portioned)- Volcano- Kosher Style Short Rib- Korean Style Short Rib- Back RIbs</li>\r\n</ol>\r\n<h3><strong>Shortloin</strong></h3>\r\n<ol>\r\n	<li>Porterhouse Steak</li>\r\n	<li>T-Bone Steak</li>\r\n</ol>\r\n<h3><strong>Sirloin</strong></h3>\r\n<ol>\r\n	<li>Full Loin- Porterhouse Steak- Bone-In Striploin Steak- Bone-In Filet Steak</li>\r\n	<li>Short Cut Loin</li>\r\n	<li>Striploin- New York Steak</li>\r\n	<li>Tenderloin</li>\r\n</ol>\r\n<h3><strong>Tenderloin</strong></h3>\r\n<ol>\r\n	<li>Tenderloin- Filet Steak- Chateau Steak- Medallions- PSMO Tenderloin- Fat-On Tenderloin</li>\r\n	<li>Short Tenderloin</li>\r\n	<li>Tenderloin Butt</li>\r\n	<li>Tenderloin Tails</li>\r\n</ol>\r\n<h3><strong>Top Sirloin</strong></h3>\r\n<ol>\r\n	<li>Bone-In Top Sirloin</li>\r\n	<li>Top Sirloin- Top Sirloin Steak- Baseball Cut Top Sirloin Steak</li>\r\n	<li>Top Sirloin Cap- Coulotte Steak- Picanha (Brazilian St