(53, 1, '2015-10-02 11:22:08', '2015-10-02 18:22:08', '<h1>Beef</h1>\r\n<h3><em>In the RB Tradition</em></h3>\r\nWe are committed to providing consistently high quality product to our clientele, and we can do so because of our long-standing relationships with reputable meat suppliers.  Our buyers have over 100 years of combined meat-buying experience.\r\n<ul class="list">\r\n	<li><a class="nyroModal" href="http://rockerbrosmeat.com/pop_up.htm#supply">Suppliers</a></li>\r\n	<li><a class="nyroModal" href="http://rockerbrosmeat.com/pop_up.htm#market">Market demands</a></li>\r\n	<li><a class="nyroModal" href="http://rockerbrosmeat.com/pop_up.htm#grading">Grading</a></li>\r\n</ul>\r\n<h3>USDA Prime</h3>\r\n<p class="outline">Prime grade beef is superior in tenderness, juiciness and flavor.</p>\r\nPrime graded beef contains a combined high ratio of marbling with the youngest maturity of beef. It is significantly higher in price because less than 2% of the beef graded is Prime.\r\n<h3>USDA Choice</h3>\r\nChoice grade beef is the second highest grade of beef. It has less marbling than Prime, however still contains sufficient marbling for tenderness and taste. This is the most popular grade of beef.\r\n<h3>USDA Select</h3>\r\nSelect grade beef is somewhat leaner and  very uniform in quality. It is fairly tender, but, because it has very little marbling, it may lack some of the juiciness and flavor of the higher grades. This grade is ideal for marinating.\r\n<h2>Breed</h2>\r\n<h3>Angus Beef</h3>\r\nA Scottish breed of cattle, formerly called <a href="http://en.wikipedia.org/wiki/Aberdeenshire_%28historic%29">Aberdeen</a> <a href="http://en.wikipedia.org/wiki/Angus">Angus</a> after their place of origin. Angus cattle are among the most commonly used breeds in American beef production. They are popular among producers and consumers because they have more meat on their bones than other breeds as well as distinctive " marbling" — the flecks of fat which contribute to flavor and texture.\r\n\r\n<strong>Black Angus</strong>, which refers to the predominant coloring amongst the original Scottish Aberdeen Angus population. If a color is not specified when referring to Angus cattle, it\'s presumed to be black.\r\n\r\n<a href="http://en.wikipedia.org/wiki/Red_Angus">Red Angus</a>, a breed resulting from the selection of red individuals from the Angus population, which has always had both red and black individuals.\r\n<h3>Domestic and Australian Kobe Style</h3>\r\nKobe beef is known worldwide for its marbling characteristics, naturally enhanced flavor, tenderness and juiciness. It is also known for its high market value.\r\n\r\nDomestic and Australian Kobe style is imported Japanese Kobe Wagyu cattle crossbred with Angus cattle to span and survive US climate. It is fed a special grain, mimicking Japanese feed of corn, alfalfa, barley and wheat-straw for a minimum of 350 days. Extended feed time and special grain, contribute to the high fat marbling in this beef.\r\n\r\n<a href="http://rockerbrosmeat.com/product-lines/beef/beef-cuts/">Beef Cuts</a>', 'Beef', '', 'inherit', 'closed', 'closed', '', '31-revision-v1', '', '', '2015-10-02 11:22:08', '2015-10-02 18:22:08', '', 31, 'http://rockerbrosmeat.com/2015/10/02/31-revision-v1/', 0, 'revision', '', 0),
(54, 1, '2015-10-02 11:23:39', '2015-10-02 18:23:39', '<h1>Pork</h1>\r\n&nbsp;\r\n\r\nWe not only provide you with any cut of pork, from whole loins to rack chops, but we carry pork products from a variety of specialty pork vendors to satisfy every request.\r\n\r\n<strong>IBP</strong> – their fine quality Mid-Western pork program provides us with the most consistently flavorful and reasonably priced pork cuts.\r\n\r\n<strong>Prime Pork</strong> – a flavor sensation at an unbeatable price. Prime pork comes from an Iowa based provider, and their unique program is a reasonably priced substitute for some of the more expensive pork products like Kurobuta.\r\n\r\n<strong>Kurobuta</strong> – Berkshire pork is called Kurobuta (Black Hog) in Japan. Darker looking than standard pork, Kurobuta is known for it’s good marbling, richer taste, and is never injected with brine water (seasoning) as some pork is.\r\n\r\n<strong>Good Nature Pork</strong> is free of antibiotics, growth stimulants and preservatives - animals are raised on a 100% vegetarian diet on farms in the Midwest, where farmers adhere to stringent animal health and humane treatment practices.\r\n\r\n<strong>Beelers Pork</strong> Duroc breed pigs raised humanely, compassionately, naturally.\r\n\r\n<strong>Cook Pigs Ranch</strong> <a href="http://www.cookpigs.com/" target="_blank">www.cookpigs.com</a> - Rocker Brothers is proud to feature Cook Pigs Ranch Heritage pork. Cooks is family owned, located in Julian, California and produces the finest Humanely raised Heritage pork in Southern California. Cooks takes great pride in the slow-growth approach to pasture raising their pigs, which are pasture raised on a healthy all-natural diet in a beautiful and peaceful environment.\r\n\r\nWe are currently stocking at Rocker Brothers all Cook Pigs Ranch primals and subprimals and have inventory arriving weekly, whole and half pigs are available with pre-order. We are ready to get Cooks on your menu, you won’t believe the quality and flavor of this local raised, sustainable Heritage pork. Please let us help you get the finest pork in Southern California at your tables today.\r\n\r\nFor more information visit <a href="http://www.cookpigs.com/" target="_blank">Cook Pigs Ranch</a> website or contact Christian Shaffer at Rocker Brothers Meat.', 'Pork', '', 'inherit', 'closed', 'closed', '', '33-revision-v1', '', '', '2015-10-02 11:23:39', '2015-10-02 18:23:39', '', 33, 'http://rockerbrosmeat.com/2015/10/02/33-revision-v1/', 0, 'revision', '', 0),
(55, 1, '2015-10-02 11:24:04', '2015-10-02 18:24:04', '<h1>Lamb</h1>\r\n<strong>Superior Farms Lamb:</strong> One of our fine lamb suppliers, Superior provides us with well-known, fine tasting, Colorado Lamb and we make this available to you in primal cuts or by whole animal.\r\n\r\n<strong>Superior Pure –</strong> Lamb raised by Superior Farms on their Superior Pure program are all raised naturally, on family farms in America. This lamb is also available in cuts or by whole animal.\r\n\r\n<strong>Australian –</strong> we offer Australian lamb products, which come in various sizes, including large 28 up lamb racks. Our Australian product is well priced, and delivered cap off, ready to cut and serve.\r\n\r\n<strong>New Zealand –</strong> We keep a variety of sizes of New Zealand lamb in stock, from 10 – 12 oz to 24 oz and up. Lamb from New Zealand is quite nice and extremely well priced.', 'Lamb', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2015-10-02 11:24:04', '2015-10-02 18:24:04', '', 35, 'http://rockerbrosmeat.com/2015/10/02/35-revision-v1/', 0, 'revision', '', 0),
(56, 1, '2015-10-02 11:24:29', '2015-10-02 18:24:29', '<h1>Veal</h1>\r\nOur primary veal supplier is Provimi Veal.\r\n\r\n<strong>Provimi Wisconsin</strong> raised veal is available as a purely milk-fed (white) meat or free range (pink in color), natural veal, which is both milk fed and pasture raised.', 'Veal', '', 'inherit', 'closed', 'closed', '', '37-revision-v1', '', '', '2015-10-02 11:24:29', '2015-10-02 18:24:29', '', 37, 'http://rockerbrosmeat.com/2015/10/02/37-revision-v1/', 0, 'revision', '', 0),
(57, 1, '2015-10-02 11:25:10', '2015-10-02 18:25:10', '<h1>Poultry</h1>\r\n<h2>Chicken:</h2>\r\n<strong>JIDORI</strong> is a Japanese term that translates to “chicken of the earth”. These birds are raised locally, picked up by Rocker Bros daily, and can be delivered to our customers within 24 hours of slaughter. This is the freshest chicken available in CA. We sell most of our Jidori 100% natural, humanely raised chickens with head on and feet on, as is traditional, and usually as our chefs request.\r\n\r\n<strong>MARY’S</strong> brand free range Chicken and Turkey from Pitman Farms in Northern California is 100% naturally raised, and unlike any other chicken, is 100% air-chilled. The air-chill process means that the Mary’s chicken never enters the water for cooling during processing, as most birds do. The air-chill process helps ensure purity and reduce water retention. Pittman Farms is known for their exceptional care in raising and processing chicken - we are happy to carry their fine line of poultry.\r\n\r\n<strong>FOSTER FARMS</strong> delivers fresh to Rocker Bros several times a week. Our Foster birds are raised in CA, cage free, and very affordable. You can buy cage free, natural, and locally raised Foster Farms chicken from us for about 15 cents a pound more than standard Mid-western commodity birds – well worth it!\r\n\r\nIn order to provide for every request in the chicken department – we offer all parts/cuts, including: boneless/skinless and boneless/skin-on sized breasts from 4 to 12 oz, and bone-in/skin on breasts from 10-32 oz. We have our natural and fresh chicken breasts, as well as frozen marinated breasts.\r\n\r\nAll chicken parts – or whole chickens - are available from any brand you prefer.\r\n<h2>Turkey:</h2>\r\n<strong>Mary’s – Pitman Farms</strong> all natural air-chilled Turkeys are exceptional. We have been told by chefs that the Mary’s from Pittman Farms are the best they have ever eaten.\r\n\r\n<strong>Sun Valley Farms</strong> is also a California turkey provider, and offers all natural turkeys for a bit less money.\r\n\r\nWe also offer <strong>Just Perfect, Butterball</strong> and <strong>North Country Smokehouse</strong> brands of roasted and smoked turkey breast.\r\n\r\n<strong>BN Ranch Pasture Raised 100% Natural Turkey</strong> - We are taking commitments for Bill\'s amazing Turkeys. They are available Fresh for Thanksgiving (and fresh/frozen all year round)\r\n<ul class="list">\r\n	<li><strong>Heritage Breed - </strong>Weight categories are: 7-10, 10-13, 13-15, 15-18 and 18+ lbs.</li>\r\n	<li><strong>Broad Breasted White - </strong>Weight categories are: 12-15, 15-18, 18-21 and 21+ lbs.</li>\r\n	<li><a href="http://eatlikeitmatters.com/our-products/heritage-turkeys/" target="_blank">Click Here for More Information</a></li>\r\n	<li>For more info. and to place an order, contact: <a href="mailto:debbie@rbpureandnatural.com">Debbie Rocker</a></li>\r\n</ul>\r\n<h2>Duck:</h2>\r\nWe carry Muscovy, Pekin Long Island, and Maple Leaf brands duck and duck breast. We also have fresh Woodland Duck from Northern CA and fresh Muscovy from Grimaud Farms in Sonoma CA.', 'Poultry', '', 'inherit', 'closed', 'closed', '', '39-revision-v1', '', '', '2015-10-02 11:25:10', '2015-10-02 18:25:10', '', 39, 'http://rockerbrosmeat.com/2015/10/02/39-revision-v1/', 0, 'revision', '', 0),
(58, 1, '2015-10-02 12:08:32', '2015-10-02 19:08:32', '<h1>Smoked Meat</h1>\r\n<div class="flright border">\r\n<div id="master1">\r\n<div id="canvas1_0"></div>\r\n</div>\r\n</div>\r\n<strong>Hormel –</strong> we are a direct distributor for all Hormel Brands. They have some of the finest bacon you can buy.\r\n\r\n<strong>North Country Smokehouse –</strong> We exclusively distribute the North Country Smokehouse products in Los Angeles. Their artisanal smoked meats are some of the finest we have tasted and they offer, among other things, a line of all natural, nitrite free smoked products.\r\n\r\n<strong>Daily’s Bacon –</strong> our house brand, delicious and reasonably priced. We carry thick and thinly sliced, regular and applewood smoke in slab or sliced\r\n<h2>We also carry:</h2>\r\n<strong>Russak\'s –</strong> One if the finest company’s selling cured and smoked products, we proudly sell the Russak’s brand roast beef, corned beef, pastrami, and more.\r\n\r\n<strong>Jodi Maroni Sausages –</strong> A real crowd-pleaser, we carry the Jodi Maroni raw and cooked sausages in various flavor profiles.\r\n\r\n<strong>Specialy Sausages –</strong> Ask about our specialty sausages from different countries – we carry some of the finest, and most unusual sausages you can find.', 'Smoked Meat', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2015-10-02 12:08:32', '2015-10-02 19:08:32', '', 41, 'http://rockerbrosmeat.com/2015/10/02/41-revision-v1/', 0, 'revision', '', 0),
(59, 1, '2015-10-02 12:08:46', '2015-10-02 19:08:46', '<h1>Smoked Meat</h1>\r\n<div class="flright border"></div>\r\n<strong>Hormel –</strong> we are a direct distributor for all Hormel Brands. They have some of the finest bacon you can buy.\r\n\r\n<strong>North Country Smokehouse –</strong> We exclusively distribute the North Country Smokehouse products in Los Angeles. Their artisanal smoked meats are some of the finest we have tasted and they offer, among other things, a line of all natural, nitrite free smoked products.\r\n\r\n<strong>Daily’s Bacon –</strong> our house brand, delicious and reasonably priced. We carry thick and thinly sliced, regular and applewood smoke in slab or sliced\r\n<h2>We also carry:</h2>\r\n<strong>Russak\'s –</strong> One if the finest company’s selling cured and smoked products, we proudly sell the Russak’s brand roast beef, corned beef, pastrami, and more.\r\n\r\n<strong>Jodi Maroni Sausages –</strong> A real crowd-pleaser, we carry the Jodi Maroni raw and cooked sausages in various flavor profiles.\r\n\r\n<strong>Specialy Sausages –</strong> Ask about our specialty sausages from different countries – we carry some of the finest, and most unusual sausages you can find.', 'Smoked Meat', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2015-10-02 12:08:46', '2015-10-02 19:08:46', '', 41, 'http://rockerbrosmeat.com/2015/10/02/41-revision-v1/', 0, 'revision', '', 0),
(60, 1, '2015-10-02 12:09:43', '2015-10-02 19:09:43', '<h1>Exotic Meats</h1>\r\nPlease <a href="http://rockerbrosmeat.com/contact_us.asp">contact us</a> if you would like information about our Exotic Meat selection.\r\n\r\nWe offer exotic poultry and game fowl: quail, Cornish game hens, rabbit, squab, pheasant, duck, guinea fowl and more.\r\n\r\nIf you are looking for game meats: wild boar, buffalo, venison, elk, or rabbit, we have a variety of providers and can deliver to you fresh or frozen.', 'Exotic Meats', '', 'inherit', 'closed', 'closed', '', '43-revision-v1', '', '', '2015-10-02 12:09:43', '2015-10-02 19:09:43', '', 43, 'http://rockerbrosmeat.com/2015/10/02/43-revision-v1/', 0, 'revision', '', 0),
(61, 1, '2015-10-02 12:10:42', '2015-10-02 19:10:42', '<h1>Green Healthy Humane</h1>\r\nAt Rocker Bros, recognized the importance of buying locally whenever possible, and finding naturally raised, humanely farmed meats to add to our Premium line of Rocker Bros. Meats.\r\n\r\nWe have taken the time to develop relationships with companies that practice humane animal treatment, a higher level of land stewardship, and an overall greater understanding and responsibility to providing healthier animal products with minimal waste and stress on our land and animals.\r\n\r\nThese companies go beyond the current call of duty, following higher standards and practices than imposed by government agencies. We are pleased to know them, work with them and support them in our Green, Healthy, Humane endeavor.\r\n\r\nIt is a fact that going back to basics by raising animals naturally is better for our health, and the health of our environment. And the payoff is evident in the taste too. In fact the texture, flavor and tenderness of our Green, Healthy, Humane meats is shockingly delicious.\r\n\r\nIt’s nice to be able to satisfy the demands of well-known chefs and fine restaurants and, at the same time, support natural, compassionate and sustainable farming practices too.\r\n\r\n<strong>Green Healthy, Humane</strong> meats, meet these requirements:\r\n<ul class="list">\r\n<ul class="list">\r\n	<li>Great taste!</li>\r\n	<li>100% Natural and/or Certified Organic</li>\r\n	<li>No hormone or antibiotic injections</li>\r\n	<li>Raised Locally</li>\r\n	<li>Minimally Processed</li>\r\n</ul>\r\n</ul>\r\n<ul class="list">\r\n	<li>Animals live in Healthy Humane Environments</li>\r\n	<li>Animals are raised on sustainable farms, and/or ecologically responsible small family farms</li>\r\n</ul>\r\n<strong>Beelers Duroc Pork</strong>\r\nBeelers pigs are raised with compassion, naturally. They reside in Heluka houses, which are designed to provide the most comfort and pleasure for pigs as they can lounge around in the deep-bedded areas or bask in the sunshine at their leisure.\r\nDuroc pigs are leaner than the Berkshire (Kurobuta) breed, the pork is delicate in flavor and widely requested by chefs in Los Angeles.\r\n\r\n<strong>Jidori Chicken</strong> - Jidori” is a Japanese term that means, “chicken of the earth.”\r\nJidori Chickens are raised cage-free, fed all natural grain with no meat by-products, and raised without any hormones or steroids. They are raised in California’s Central Valley and delivered to the Los Angeles processing plant everyday , where they are processed under strict HACCP guidelines, with USDA inspection of every single bird.\r\nWe are guaranteed shipment of these farm fresh birds within 24 hours of slaughter, so that Chefs, and their patrons, receive the freshest chicken possible.\r\n\r\nUnlike beef, where aging is sometimes encouraged to tenderize the meat, chicken, like fish, is the best tasting and safest when it is the freshest.\r\nJidori freshness is unparalleled. These birds do not retain water like most other poultry does. Reduced water content greatly enhances the natural taste of chicken.\r\nJidori chickens are raised by a small number of farmers, and they are processed here in LA in a small boutique processing plant, this ensures complete control throughout the supply chain.', 'Green, Healthy, Humane', '', 'inherit', 'closed', 'closed', '', '45-revision-v1', '', '', '2015-10-02 12:10:42', '2015-10-02 19:10:42', '', 45, 'http://rockerbrosmeat.com/2015/10/02/45-revision-v1/', 0, 'revision', '', 0),
(64, 1, '2015-10-02 12:17:27', '2015-10-02 19:17:27', '<strong>Proprietor</strong>\r\n\r\nShelly Rocker has been wearing a white meat coat as far back as can be remembered. As a teenager, he enthusiastically began his career in the meat industry working for his father. He spent his high school years splitting his days between school and working in the plant learning every phase of production. Back in the day there was a very limited supply of boxed beef. Therefore, his father’s meat company broke cattle and processed from the hanging cattle. In his quest for knowledge, Shelly educated himself by working every single position and learning each processing procedure involved in meat production.\r\n\r\nShelly took a few years and set off to attend Humboldt University. After graduating, he was eager to return to the family business and perfect his education of the business. Upon his return, his father relocated and opened a USDA plant in Inglewood, California (current location of Rocker Bros Meat &amp; Provision, Inc.). With the move, it was time for Shelly to share his knowledge and hit the streets. Thus began a very successful career in sales. Within a short amount of time, he created a significant portfolio of respectable accounts.\r\n\r\nShelly’s love for the food industry eventually took him on a new venture. In partnership with two close friends, and pursuing a dream he opened a successful chain of diners, Rocky Cola Café. His many years of experience in the restaurant business expanded his knowledge and refined his understanding of the industry to a broader level.\r\n\r\nWith a need to get back into the meat business and a change in ownership of his father’s company, ultimately led Shelly to his destiny. With a new vision, he teamed up with his brother, David, and opened Rocker Bros Meat &amp; Provision, Inc. Their shared vision is a company specializing in proteins, and nothing else. Today, they run their company the old fashion way, the same way that made their father successful, the “Butcher Shop” style. . cut product to order and according to the customer’s needs and specifications.\r\n\r\nShelly’s vast knowledge and experience has given him the ability and creativity to bring new innovative ideas and products in combination with the old standards to the restaurant and hotel industry. Rocker Bros and its clients continue to benefit from his talent. Noticing the growing interest in the Natural and Organic market, he has acquired new product lines that are receiving rave reviews.\r\n\r\nWith Shelly’s dedication, Rocker Bros. Meat continues to carve itself a niche in the LA market. His experience is earning Rocker Bros a reputation as a highly serviced and quality-minded business compared to the larger more corporate style meat companies in the city.\r\n\r\n<hr />\r\n\r\n<h3>To contact Sheldon Rocker please call:</h3>\r\n<strong>Office:</strong> (310) 674-0541 <strong>Cell:</strong> (310) 962-2783 <strong>E-mail:</strong> <a href="mailto:SRocker@rockerbrosmeat.com">SRocker@rockerbrosmeat.com</a>', 'Sheldon Rocker', '', 'publish', 'closed', 'closed', '', 'sheldon-rocker', '', '', '2016-04-04 13:26:21', '2016-04-04 20:26:21', '', 7, 'http://rockerbrosmeat.com/?page_id=64', 0, 'page', '', 0),
