(90, 1, '2015-10-08 13:57:13', '2015-10-08 20:57:13', 'Rocker Bros. Meats &amp; Provisions, Inc. is a family operated business with a combined 100-years-plus of meat buying, processing, and distributing experience. Our father started Holiday Meat &amp; Provisions in 1965 and the torch has now been passed to Shelly and David, who operate Rocker Bros. Meat &amp; Provisions with the same old-fashioned values, plus a whole new set of working dynamics for higher quality, greater efficiency and better customer satisfaction.\r\n\r\nCustomer Satisfaction is goal number 1:\r\n\r\nIt is our job, and our goal, to provide chefs with meat products that make their dishes delicious and profitable. We consider ourselves partners with our restaurant owners and chefs. We are the personal, custom butcher shop that every cooking professional needs. We provide cut and cooking suggestions, professional yield testing, premium buying services, and customized processing, like dry aging, trimming and portioning specific to our chef’s wishes.\r\n\r\nOur Midwest suppliers provide us with the finest USDA primal cuts, which we age and process to your exact specifications. We operate under USDA Establishment 1160 and follow strict USDA HACCP regulations. We feature a full line of all meat products, including beef, pork, lamb, veal, poultry, and fresh seafood.\r\n\r\nWe are proud of our high-quality product lines and exclusive relationships with companies such as Sonoma Direct for whom we distribute pasture-raised lamb, pork and other delicious meats that are raised on sustainable family farms.\r\n\r\nAt Rocker Bros, our specialty is portion control. Our butchers are the finest in the meat industry, and some of them have been with us for over 30 years. Their cutting is precise, and we are regularly creating, with our chefs, cuts uniquely designed for their menus. Kobe-style steaks, bone-in filets, beef and lamb short rib osso-buco (Volcano), prime, dry aged cross-cut new york steaks, and prime rib eye medallions, are a few examples.\r\n\r\nWe work really hard to supply our customers with the highest quality meat products at the most affordable prices. Our customers are pleasantly surprised when they realize that often they can buy USDA Prime beef at USDA Choice beef prices.\r\n\r\nWe will come to you and design a program that will enhance your menu with new, innovative products, and prices that will make you (and your customers) very happy. And we invite you to come and take a tour of Rocker Bros unique " boutique" meat environment. Walk through the dry age room, discover and sample new items, and let us customize a meat program just for you.\r\n\r\n<hr />\r\n\r\n<h2>Bios</h2>\r\n<strong>Sheldon Rocker</strong>\r\nProprietor\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/sheldon-rocker/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Debbie Rocker </strong>\r\nExecutive - RB Pure and Natural\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/debbie-rocker/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Chef Christian Shaffer</strong>\r\nAccount Executive\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/chef-christian-shaffer/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Chef Brian Thomas</strong>\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/brian-thomas/">Full Bio</a>', 'About Us', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2015-10-08 13:57:13', '2015-10-08 20:57:13', '', 7, 'http://rockerbrosmeat.com/2015/10/08/7-revision-v1/', 0, 'revision', '', 0),
(91, 1, '2015-10-09 09:46:17', '2015-10-09 16:46:17', '<h2>Our History</h2>\r\nRocker Bros. Meats &amp; Provisions, Inc. is a family operated business with a combined 100-years-plus of meat buying, processing, and distributing experience. Our father started Holiday Meat &amp; Provisions in 1965 and the torch has now been passed to Shelly and David, who operate Rocker Bros. Meat &amp; Provisions with the same old-fashioned values, plus a whole new set of working dynamics for higher quality, greater efficiency and better customer satisfaction.\r\n\r\nCustomer Satisfaction is goal number 1:\r\n\r\nIt is our job, and our goal, to provide chefs with meat products that make their dishes delicious and profitable. We consider ourselves partners with our restaurant owners and chefs. We are the personal, custom butcher shop that every cooking professional needs. We provide cut and cooking suggestions, professional yield testing, premium buying services, and customized processing, like dry aging, trimming and portioning specific to our chef’s wishes.\r\n\r\nOur Midwest suppliers provide us with the finest USDA primal cuts, which we age and process to your exact specifications. We operate under USDA Establishment 1160 and follow strict USDA HACCP regulations. We feature a full line of all meat products, including beef, pork, lamb, veal, poultry, and fresh seafood.\r\n\r\nWe are proud of our high-quality product lines and exclusive relationships with companies such as Sonoma Direct for whom we distribute pasture-raised lamb, pork and other delicious meats that are raised on sustainable family farms.\r\n\r\nAt Rocker Bros, our specialty is portion control. Our butchers are the finest in the meat industry, and some of them have been with us for over 30 years. Their cutting is precise, and we are regularly creating, with our chefs, cuts uniquely designed for their menus. Kobe-style steaks, bone-in filets, beef and lamb short rib osso-buco (Volcano), prime, dry aged cross-cut new york steaks, and prime rib eye medallions, are a few examples.\r\n\r\nWe work really hard to supply our customers with the highest quality meat products at the most affordable prices. Our customers are pleasantly surprised when they realize that often they can buy USDA Prime beef at USDA Choice beef prices.\r\n\r\nWe will come to you and design a program that will enhance your menu with new, innovative products, and prices that will make you (and your customers) very happy. And we invite you to come and take a tour of Rocker Bros unique " boutique" meat environment. Walk through the dry age room, discover and sample new items, and let us customize a meat program just for you.\r\n\r\n<hr />\r\n\r\n<h2>Bios</h2>\r\n<strong>Sheldon Rocker</strong>\r\nProprietor\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/sheldon-rocker/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Debbie Rocker </strong>\r\nExecutive - RB Pure and Natural\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/debbie-rocker/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Chef Christian Shaffer</strong>\r\nAccount Executive\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/chef-christian-shaffer/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Chef Brian Thomas</strong>\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/brian-thomas/">Full Bio</a>', 'About Us', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2015-10-09 09:46:17', '2015-10-09 16:46:17', '', 7, 'http://rockerbrosmeat.com/2015/10/09/7-revision-v1/', 0, 'revision', '', 0),
(92, 1, '2015-10-09 09:54:43', '2015-10-09 16:54:43', '<h2>Rocker Bros Delivers - Think Outside The Box</h2>\r\nRocker Bros offers a BOX-FREE delivery option. This delivery experiment was originally a joint effort between The HOUSTON’S Restaurant chain (a very environmentally conscious organization) and ROCKER BROS in early 2010.\r\n\r\nROCKER BROS, the only meat company offering BOX FREE deliveries, now offers BOX FREE meat deliveries, in our USDA approved reusable plastic totes, to all of our customers.\r\n\r\nOf course, any cardboard delivery boxes we use are made from recycled paper products.\r\n<h2>Rocker Bros Delivers..</h2>\r\nYour meats are delivered in refrigerated vans six days a week. Saturday deliveries are no extra charge, and though we have no minimum delivery fee, we do ask that our customers consider the environment when ordering - fewer deliveries means less waste, greater efficiency, and savings to all.', 'Deliveries', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2015-10-09 09:54:43', '2015-10-09 16:54:43', '', 11, 'http://rockerbrosmeat.com/2015/10/09/11-revision-v1/', 0, 'revision', '', 0),
(93, 1, '2015-10-09 09:54:46', '2015-10-09 16:54:46', '<h2>Rocker Bros Delivers - Think Outside The Box</h2>\nRocker Bros offers a BOX-FREE delivery option. This delivery experiment was originally a joint effort between The HOUSTON’S Restaurant chain (a very environmentally conscious organization) and ROCKER BROS in early 2010.\n\nROCKER BROS, the only meat company offering BOX FREE deliveries, now offers BOX FREE meat deliveries, in our USDA approved reusable plastic totes, to all of our customers.\n\nOf course, any cardboard delivery boxes we use are made from recycled paper products.\n<h2>Rocker Bros Delivers..</h2>\nYour meats are delivered in refrigerated vans six days a week. Saturday deliveries are no extra charge, and though we have no minimum delivery fee, we do ask that our customers consider the environment when ordering - fewer deliveries means less waste, greater efficiency, and savings to all.', 'Deliveries', '', 'inherit', 'closed', 'closed', '', '11-autosave-v1', '', '', '2015-10-09 09:54:46', '2015-10-09 16:54:46', '', 11, 'http://rockerbrosmeat.com/2015/10/09/11-autosave-v1/', 0, 'revision', '', 0),
