(110, 1, '2015-10-14 10:15:46', '2015-10-14 17:15:46', 'Our goal is to provide ongoing support for our customers, so we work side by side with our chefs and restaurant owners to establish what it is they need and give them what they want. We provide top quality products, premium services, and personal attention, with ease, to our clientele. And we recognize the importance of staying ahead of the curve, so we are always searching for unique products and fresh ideas to bring to the table.\r\n<div style="display: none;">\r\n\r\nWe have seasoned meat buyers and over 100 years of combined meat buying experience at Rocker Bros. Our expert butchers are the best in the business and some have been a part of our family for over 3 decades.\r\n\r\nOur professional chefs, well informed sales staff, and professional account managers work together to take care of, and provide for, whatever is needed by our restaurant chef\'s and owners.\r\n\r\nAnd, we encourage our chefs to walk through the Rocker Bros Meat facility and experience, first hand, what we do. So, consider this an invitation – visit us in Inglewood, walk through the cutting room floor, inspect the dry age room, and let us show you unique ways to delight your customers and keep your food costs down.\r\n\r\nWe are told over and over that nothing is more informative, or idea inspiring, than a Rocker Bros tour.\r\n\r\nAlso, and very importantly, we make great efforts to respect the animals, and the environment. You’ll see that we really do mean what we say when you read about our box-free deliveries and <a href="http://rockerbrosmeat.com/product-lines/green-healthy-humane/">Green, Healthy, Humane</a> program commitment.\r\n\r\n</div>', 'Our Goal', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2015-10-14 10:15:46', '2015-10-14 17:15:46', '', 2, 'http://rockerbrosmeat.com/2015/10/14/2-revision-v1/', 0, 'revision', '', 0),
