(124, 1, '2015-10-28 12:51:53', '2015-10-28 19:51:53', '<h2>Our History</h2>\r\nRocker Bros. Meats &amp; Provisions, Inc. is a family operated business with a combined 100-years-plus of meat buying, processing, and distributing experience. Our father started Holiday Meat &amp; Provisions in 1965 and the torch has now been passed to Shelly and David, who operate Rocker Bros. Meat &amp; Provisions with the same old-fashioned values, plus a whole new set of working dynamics for higher quality, greater efficiency and better customer satisfaction.\r\n\r\n<strong>Customer Satisfaction is goal number 1:</strong>\r\n\r\nIt is our job, and our goal, to provide chefs with meat products that make their dishes delicious and profitable. We consider ourselves partners with our restaurant owners and chefs. We are the personal, custom butcher shop that every cooking professional needs. We provide cut and cooking suggestions, professional yield testing, premium buying services, and customized processing, like dry aging, trimming and portioning specific to our chef’s wishes.\r\n\r\nOur Midwest suppliers provide us with the finest USDA primal cuts, which we age and process to your exact specifications. We operate under USDA Establishment 1160 and follow strict USDA HACCP regulations. We feature a full line of all meat products, including beef, pork, lamb, veal, poultry, and fresh seafood.\r\n\r\nWe are proud of our high-quality product lines and exclusive relationships with companies such as Sonoma Direct for whom we distribute pasture-raised lamb, pork and other delicious meats that are raised on sustainable family farms.\r\n\r\nAt Rocker Bros, our specialty is portion control. Our butchers are the finest in the meat industry, and some of them have been with us for over 30 years. Their cutting is precise, and we are regularly creating, with our chefs, cuts uniquely designed for their menus. Kobe-style steaks, bone-in filets, beef and lamb short rib osso-buco (Volcano), prime, dry aged cross-cut new york steaks, and prime rib eye medallions, are a few examples.\r\n\r\nWe work really hard to supply our customers with the highest quality meat products at the most affordable prices. Our customers are pleasantly surprised when they realize that often they can buy USDA Prime beef at USDA Choice beef prices.\r\n\r\nWe will come to you and design a program that will enhance your menu with new, innovative products, and prices that will make you (and your customers) very happy. And we invite you to come and take a tour of Rocker Bros unique " boutique" meat environment. Walk through the dry age room, discover and sample new items, and let us customize a meat program just for you.\r\n\r\n<hr />\r\n\r\n<h2>Bios</h2>\r\n<strong>Sheldon Rocker</strong>\r\nProprietor\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/sheldon-rocker/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Debbie Rocker </strong>\r\nExecutive - RB Pure and Natural\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/debbie-rocker/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Chef Christian Shaffer</strong>\r\nAccount Executive\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/chef-christian-shaffer/">Full Bio</a>\r\n\r\n<hr noshade="noshade" size="1" width="100%" />\r\n\r\n<strong>Chef Brian Thomas</strong>\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/brian-thomas/">Full Bio</a>', 'About Us', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2015-10-28 12:51:53', '2015-10-28 19:51:53', '', 7, 'http://rockerbrosmeat.com/2015/10/28/7-revision-v1/', 0, 'revision', '', 0),
(125, 1, '2015-10-28 12:53:06', '2015-10-28 19:53:06', '<h2>Our History</h2>\r\nRocker Bros. Meats &amp; Provisions, Inc. is a family operated business with a combined 100-years-plus of meat buying, processing, and distributing experience. Our father started Holiday Meat &amp; Provisions in 1965 and the torch has now been passed to Shelly and David, who operate Rocker Bros. Meat &amp; Provisions with the same old-fashioned values, plus a whole new set of working dynamics for higher quality, greater efficiency and better customer satisfaction.\r\n\r\n<strong>Customer Satisfaction is goal number 1:</strong>\r\n\r\nIt is our job, and our goal, to provide chefs with meat products that make their dishes delicious and profitable. We consider ourselves partners with our restaurant owners and chefs. We are the personal, custom butcher shop that every cooking professional needs. We provide cut and cooking suggestions, professional yield testing, premium buying services, and customized processing, like dry aging, trimming and portioning specific to our chef’s wishes.\r\n\r\nOur Midwest suppliers provide us with the finest USDA primal cuts, which we age and process to your exact specifications. We operate under USDA Establishment 1160 and follow strict USDA HACCP regulations. We feature a full line of all meat products, including beef, pork, lamb, veal, poultry, and fresh seafood.\r\n\r\nWe are proud of our high-quality product lines and exclusive relationships with companies such as Sonoma Direct for whom we distribute pasture-raised lamb, pork and other delicious meats that are raised on sustainable family farms.\r\n\r\nAt Rocker Bros, our specialty is portion control. Our butchers are the finest in the meat industry, and some of them have been with us for over 30 years. Their cutting is precise, and we are regularly creating, with our chefs, cuts uniquely designed for their menus. Kobe-style steaks, bone-in filets, beef and lamb short rib osso-buco (Volcano), prime, dry aged cross-cut new york steaks, and prime rib eye medallions, are a few examples.\r\n\r\nWe work really hard to supply our customers with the highest quality meat products at the most affordable prices. Our customers are pleasantly surprised when they realize that often they can buy USDA Prime beef at USDA Choice beef prices.\r\n\r\nWe will come to you and design a program that will enhance your menu with new, innovative products, and prices that will make you (and your customers) very happy. And we invite you to come and take a tour of Rocker Bros unique " boutique" meat environment. Walk through the dry age room, discover and sample new items, and let us customize a meat program just for you.\r\n\r\n<hr />\r\n\r\n<h2>Bios</h2>\r\n<strong>Sheldon Rocker</strong>\r\nProprietor\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/sheldon-rocker/">Full Bio</a>\r\n\r\n<hr />\r\n\r\n<strong>Debbie Rocker </strong>\r\nExecutive - RB Pure and Natural\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/debbie-rocker/">Full Bio</a>\r\n\r\n<hr />\r\n\r\n<strong>Chef Christian Shaffer</strong>\r\nAccount Executive\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/chef-christian-shaffer/">Full Bio</a>\r\n\r\n<hr />\r\n\r\n<strong>Chef Brian Thomas</strong>\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/brian-thomas/">Full Bio</a>', 'About Us', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2015-10-28 12:53:06', '2015-10-28 19:53:06', '', 7, 'http://rockerbrosmeat.com/2015/10/28/7-revision-v1/', 0, 'revision', '', 0),
(126, 1, '2015-10-28 12:53:45', '2015-10-28 19:53:45', '<h2><strong>Sheldon Rocker </strong>\r\nProprietor</h2>\r\nShelly Rocker has been wearing a white meat coat as far back as can be remembered. As a teenager, he enthusiastically began his career in the meat industry working for his father. He spent his high school years splitting his days between school and working in the plant learning every phase of production. Back in the day there was a very limited supply of boxed beef. Therefore, his father’s meat company broke cattle and processed from the hanging cattle. In his quest for knowledge, Shelly educated himself by working every single position and learning each processing procedure involved in meat production.\r\n\r\nShelly took a few years and set off to attend Humboldt University. After graduating, he was eager to return to the family business and perfect his education of the business. Upon his return, his father relocated and opened a USDA plant in Inglewood, California (current location of Rocker Bros Meat &amp; Provision, Inc.). With the move, it was time for Shelly to share his knowledge and hit the streets. Thus began a very successful career in sales. Within a short amount of time, he created a significant portfolio of respectable accounts.\r\n\r\nShelly’s love for the food industry eventually took him on a new venture. In partnership with two close friends, and pursuing a dream he opened a successful chain of diners, Rocky Cola Café. His many years of experience in the restaurant business expanded his knowledge and refined his understanding of the industry to a broader level.\r\n\r\nWith a need to get back into the meat business and a change in ownership of his father’s company, ultimately led Shelly to his destiny. With a new vision, he teamed up with his brother, David, and opened Rocker Bros Meat &amp; Provision, Inc. Their shared vision is a company specializing in proteins, and nothing else. Today, they run their company the old fashion way, the same way that made their father successful, the “Butcher Shop” style. . cut product to order and according to the customer’s needs and specifications.\r\n\r\nShelly’s vast knowledge and experience has given him the ability and creativity to bring new innovative ideas and products in combination with the old standards to the restaurant and hotel industry. Rocker Bros and its clients continue to benefit from his talent. Noticing the growing interest in the Natural and Organic market, he has acquired new product lines that are receiving rave reviews.\r\n\r\nWith Shelly’s dedication, Rocker Bros. Meat continues to carve itself a niche in the LA market. His experience is earning Rocker Bros a reputation as a highly serviced and quality-minded business compared to the larger more corporate style meat companies in the city.\r\n\r\n<strong>To contact Sheldon Rocker please call:</strong>\r\n\r\n<strong>Office:</strong> (310) 674-0541 <strong>Cell:</strong> (310) 962-2783 <strong>E-mail:</strong> <a class="bodyLink" href="mailto:rockerbros@sbcglobal.net">rockerbros@sbcglobal.net</a>', 'Sheldon Rocker', '', 'inherit', 'closed', 'closed', '', '64-revision-v1', '', '', '2015-10-28 12:53:45', '2015-10-28 19:53:45', '', 64, 'http://rockerbrosmeat.com/2015/10/28/64-revision-v1/', 0, 'revision', '', 0),
