(137, 1, '2015-10-28 13:00:13', '2015-10-28 20:00:13', '<h2>Rocker Bros Delivers - Think Outside The Box</h2>\r\nRocker Bros offers a BOX-FREE delivery option. This delivery experiment was originally a joint effort between The HOUSTON’S Restaurant chain (a very environmentally conscious organization) and ROCKER BROS in early 2010.\r\n\r\nROCKER BROS, the only meat company offering BOX FREE deliveries, now offers BOX FREE meat deliveries, in our USDA approved reusable plastic totes, to all of our customers.\r\n\r\nOf course, any cardboard delivery boxes we use are made from recycled paper products.\r\n\r\n<hr>\r\n\r\n<h2>Rocker Bros Delivers..</h2>\r\nYour meats are delivered in refrigerated vans six days a week. Saturday deliveries are no extra charge, and though we have no minimum delivery fee, we do ask that our customers consider the environment when ordering - fewer deliveries means less waste, greater efficiency, and savings to all.', 'Deliveries', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2015-10-28 13:00:13', '2015-10-28 20:00:13', '', 11, 'http://rockerbrosmeat.com/2015/10/28/11-revision-v1/', 0, 'revision', '', 0),
(138, 1, '2015-10-28 13:01:09', '2015-10-28 20:01:09', 'Quality Control refers to a broad program that processors employ to ultimately assure consumers of a safe product. Rocker Bros. emphasizes on Quality Control throughout processing. We realize the only way for this to work efficiently is by enforcing all guidelines of HACCP (Hazard Analysis Critical Control Points).\r\n\r\nHACCP is the top priority of the USDA Food Safety and Inspection program (FSIS). Our plant operates under USDA Establishment 1160 and follows strict USDA HACCP regulations. Our Quality Control is directed by David Rocker, co-owner of the company.  David carefully inspects production prior to packaging, to certify quality and accuracy.\r\n\r\n<hr>\r\n\r\n<h2>Product is:</h2>\r\n<ul>\r\n	<li>Hand selected  for each customer</li>\r\n	<li>Portioned and packaged according to specification</li>\r\n	<li>Inspected for accuracy</li>\r\n	<li>Guaranteed for wholesomeness</li>\r\n</ul>', 'Standards of Excellence', '', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2015-10-28 13:01:09', '2015-10-28 20:01:09', '', 20, 'http://rockerbrosmeat.com/2015/10/28/20-revision-v1/', 0, 'revision', '', 0) ;
