(160, 1, '2015-10-28 14:43:47', '2015-10-28 21:43:47', '<strong>Hormel –</strong> we are a direct distributor for all Hormel Brands. They have some of the finest bacon you can buy.\r\n\r\n<strong>North Country Smokehouse –</strong> We exclusively distribute the North Country Smokehouse products in Los Angeles. Their artisanal smoked meats are some of the finest we have tasted and they offer, among other things, a line of all natural, nitrite free smoked products.\r\n\r\n<strong>Daily’s Bacon –</strong> our house brand, delicious and reasonably priced. We carry thick and thinly sliced, regular and applewood smoke in slab or sliced\r\n\r\n<hr>\r\n\r\n<h2>We also carry:</h2>\r\n<strong>Russak\'s –</strong> One if the finest company’s selling cured and smoked products, we proudly sell the Russak’s brand roast beef, corned beef, pastrami, and more.\r\n\r\n<strong>Jodi Maroni Sausages –</strong> A real crowd-pleaser, we carry the Jodi Maroni raw and cooked sausages in various flavor profiles.\r\n\r\n<strong>Specialy Sausages –</strong> Ask about our specialty sausages from different countries – we carry some of the finest, and most unusual sausages you can find.', 'Smoked Meat', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2015-10-28 14:43:47', '2015-10-28 21:43:47', '', 41, 'http://rockerbrosmeat.com/2015/10/28/41-revision-v1/', 0, 'revision', '', 0),
(161, 1, '2015-10-28 14:44:08', '2015-10-28 21:44:08', 'Please <a href="http://rockerbrosmeat.com/contact_us.asp">contact us</a> if you would like information about our Exotic Meat selection.\r\n\r\nWe offer exotic poultry and game fowl: quail, Cornish game hens, rabbit, squab, pheasant, duck, guinea fowl and more.\r\n\r\nIf you are looking for game meats: wild boar, buffalo, venison, elk, or rabbit, we have a variety of providers and can deliver to you fresh or frozen.', 'Exotic Meats', '', 'inherit', 'closed', 'closed', '', '43-revision-v1', '', '', '2015-10-28 14:44:08', '2015-10-28 21:44:08', '', 43, 'http://rockerbrosmeat.com/2015/10/28/43-revision-v1/', 0, 'revision', '', 0),
(162, 1, '2015-10-28 14:44:43', '2015-10-28 21:44:43', 'At Rocker Bros, recognized the importance of buying locally whenever possible, and finding naturally raised, humanely farmed meats to add to our Premium line of Rocker Bros. Meats.\r\n\r\nWe have taken the time to develop relationships with companies that practice humane animal treatment, a higher level of land stewardship, and an overall greater understanding and responsibility to providing healthier animal products with minimal waste and stress on our land and animals.\r\n\r\nThese companies go beyond the current call of duty, following higher standards and practices than imposed by government agencies. We are pleased to know them, work with them and support them in our Green, Healthy, Humane endeavor.\r\n\r\nIt is a fact that going back to basics by raising animals naturally is better for our health, and the health of our environment. And the payoff is evident in the taste too. In fact the texture, flavor and tenderness of our Green, Healthy, Humane meats is shockingly delicious.\r\n\r\nIt’s nice to be able to satisfy the demands of well-known chefs and fine restaurants and, at the same time, support natural, compassionate and sustainable farming practices too.\r\n\r\n<strong>Green Healthy, Humane</strong> meats, meet these requirements:\r\n\r\n<ul>\r\n	<li>Great taste!</li>\r\n	<li>100% Natural and/or Certified Organic</li>\r\n	<li>No hormone or antibiotic injections</li>\r\n	<li>Raised Locally</li>\r\n	<li>Minimally Processed</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Animals live in Healthy Humane Environments</li>\r\n	<li>Animals are raised on sustainable farms, and/or ecologically responsible small family farms</li>\r\n</ul>\r\n\r\n<strong>Beelers Duroc Pork</strong>\r\nBeelers pigs are raised with compassion, naturally. They reside in Heluka houses, which are designed to provide the most comfort and pleasure for pigs as they can lounge around in the deep-bedded areas or bask in the sunshine at their leisure.\r\nDuroc pigs are leaner than the Berkshire (Kurobuta) breed, the pork is delicate in flavor and widely requested by chefs in Los Angeles.\r\n\r\n<strong>Jidori Chicken</strong> - Jidori” is a Japanese term that means, “chicken of the earth.”\r\nJidori Chickens are raised cage-free, fed all natural grain with no meat by-products, and raised without any hormones or steroids. They are raised in California’s Central Valley and delivered to the Los Angeles processing plant everyday , where they are processed under strict HACCP guidelines, with USDA inspection of every single bird.\r\nWe are guaranteed shipment of these farm fresh birds within 24 hours of slaughter, so that Chefs, and their patrons, receive the freshest chicken possible.\r\n\r\nUnlike beef, where aging is sometimes encouraged to tenderize the meat, chicken, like fish, is the best tasting and safest when it is the freshest.\r\nJidori freshness is unparalleled. These birds do not retain water like most other poultry does. Reduced water content greatly enhances the natural taste of chicken.\r\nJidori chickens are raised by a small number of farmers, and they are processed here in LA in a small boutique processing plant, this ensures complete control throughout the supply chain.', 'Green, Healthy, Humane', '', 'inherit', 'closed', 'closed', '', '45-revision-v1', '', '', '2015-10-28 14:44:43', '2015-10-28 21:44:43', '', 45, 'http://rockerbrosmeat.com/2015/10/28/45-revision-v1/', 0, 'revision', '', 0),
(163, 1, '2015-10-29 11:18:11', '2015-10-29 18:18:11', 'Please <a href="http://rockerbrosmeat.com/contact-us/">contact us</a> if you would like information about our Exotic Meat selection.\r\n\r\nWe offer exotic poultry and game fowl: quail, Cornish game hens, rabbit, squab, pheasant, duck, guinea fowl and more.\r\n\r\nIf you are looking for game meats: wild boar, buffalo, venison, elk, or rabbit, we have a variety of providers and can deliver to you fresh or frozen.', 'Exotic Meats', '', 'inherit', 'closed', 'closed', '', '43-revision-v1', '', '', '2015-10-29 11:18:11', '2015-10-29 18:18:11', '', 43, 'http://rockerbrosmeat.com/2015/10/29/43-revision-v1/', 0, 'revision', '', 0),
