(190, 1, '2016-01-12 14:30:51', '2016-01-12 22:30:51', 'Only beef that is USDA inspected, and graded, can carry the USDA shield of authenticity. Grading determines the quality rating of beef, and is determined by carcass maturity, firmness, texture, color of lean (muscle), and the amount and distribution of marbling (fat) within the lean.\r\n\r\nBeef carcass quality grading is based on (1) degree of marbling and (2) degree of maturity.', 'Grading', '', 'publish', 'closed', 'closed', '', 'grading', '', '', '2016-02-01 08:31:00', '2016-02-01 16:31:00', '', 31, 'http://rockerbrosmeat.com/?page_id=190', 0, 'page', '', 0),
(192, 1, '2016-01-12 14:30:51', '2016-01-12 22:30:51', 'Only beef that is USDA inspected, and graded, can carry the USDA shield of authenticity. Grading determines the quality rating of beef, and is determined by carcass maturity, firmness, texture, color of lean (muscle), and the amount and distribution of marbling (fat) within the lean.\r\n\r\nBeef carcass quality grading is based on (1) degree of marbling and (2) degree of maturity.', 'Grading', '', 'inherit', 'closed', 'closed', '', '190-revision-v1', '', '', '2016-01-12 14:30:51', '2016-01-12 22:30:51', '', 190, 'http://rockerbrosmeat.com/2016/01/12/190-revision-v1/', 0, 'revision', '', 0),
(193, 1, '2016-01-12 14:31:27', '2016-01-12 22:31:27', 'Our chef\'s and restaurant owners have high expectations for their center-of-the-plate proteins. The beef market changes rapidly, and today branded beef lines, unique preparation, and out-of-the-ordinary cuts are in high demand.\r\n\r\nWe carry a wide range of top of the market branded beef lines, offer standard, as well as unique and hard to find items, and custom prepare your beef orders as requested.\r\n\r\nOur chefs-on-staff are available to help with questions about trends, cuts, specials, and meat preparation.', 'Market Demands', '', 'publish', 'closed', 'closed', '', 'market-demands', '', '', '2016-02-01 08:31:48', '2016-02-01 16:31:48', '', 31, 'http://rockerbrosmeat.com/?page_id=193', 0, 'page', '', 0),
