(196, 1, '2016-01-12 14:33:03', '2016-01-12 22:33:03', 'USDA Prime and Choice truly natural, never-ever (no antibiotics or hormones given - EVER) cattle raised in Colorado, with Certified Humane verification.\r\n\r\n<a href="http://aspenridgebeef.com/"><img class="alignnone wp-image-226 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/aspen-ridge-logo-200x200.png" alt="aspen-ridge-logo" width="200" height="200" /></a>\r\n\r\n<a href="http://aspenridgebeef.com/" target="_blank">Click here to visit Aspen Ridge Website &gt;</a>', 'Beef Suppliers', '', 'publish', 'closed', 'closed', '', 'suppliers', '', '', '2016-02-02 13:23:22', '2016-02-02 21:23:22', '', 31, 'http://rockerbrosmeat.com/?page_id=196', 0, 'page', '', 0),
(198, 1, '2016-01-12 14:33:03', '2016-01-12 22:33:03', 'USDA Prime and Choice truly natural, never-ever (no antibiotics or hormones given - EVER) cattle raised in Colorado, with Certified Humane verification.\r\n\r\n<a href="http://aspenridgebeef.com/" target="_blank">Click here to visit Aspen Ridge Website &gt;</a>', 'Suppliers', '', 'inherit', 'closed', 'closed', '', '196-revision-v1', '', '', '2016-01-12 14:33:03', '2016-01-12 22:33:03', '', 196, 'http://rockerbrosmeat.com/2016/01/12/196-revision-v1/', 0, 'revision', '', 0),
(199, 1, '2016-01-12 14:34:28', '2016-01-12 22:34:28', '<h2><em>In the RB Tradition</em></h2>\r\nWe are committed to providing consistently high quality product to our clientele, and we can do so because of our long-standing relationships with reputable meat suppliers.  Our buyers have over 100 years of combined meat-buying experience.\r\n<ul>\r\n	<li><a href="http://rockerbrosmeat.com/suppliers/">Suppliers</a></li>\r\n	<li><a href="http://rockerbrosmeat.com/market-demands/">Market Demands</a></li>\r\n	<li><a href="http://rockerbrosmeat.com/grading/">Grading</a></li>\r\n</ul>\r\n<a class="btn" href="http://rockerbrosmeat.com/product-lines/beef/beef-cuts/">Beef Cuts →</a>\r\n\r\n<hr />\r\n\r\n<h3>USDA Prime</h3>\r\n<p class="outline">Prime grade beef is superior in tenderness, juiciness and flavor.</p>\r\nPrime graded beef contains a combined high ratio of marbling with the youngest maturity of beef. It is significantly higher in price because less than 2% of the beef graded is Prime.\r\n\r\n<hr />\r\n\r\n<h3>USDA Choice</h3>\r\nChoice grade beef is the second highest grade of beef. It has less marbling than Prime, however still contains sufficient marbling for tenderness and taste. This is the most popular grade of beef.\r\n\r\n<hr />\r\n\r\n<h3>USDA Select</h3>\r\nSelect grade beef is somewhat leaner and  very uniform in quality. It is fairly tender, but, because it has very little marbling, it may lack some of the juiciness and flavor of the higher grades. This grade is ideal for marinating.\r\n\r\n<hr />\r\n\r\n<h2>Breed</h2>\r\n<h3>Angus Beef</h3>\r\nA Scottish breed of cattle, formerly called <a href="http://en.wikipedia.org/wiki/Aberdeenshire_%28historic%29">Aberdeen</a> <a href="http://en.wikipedia.org/wiki/Angus">Angus</a> after their place of origin. Angus cattle are among the most commonly used breeds in American beef production. They are popular among producers and consumers because they have more meat on their bones than other breeds as well as distinctive " marbling" — the flecks of fat which contribute to flavor and texture.\r\n\r\n<strong>Black Angus</strong>, which refers to the predominant coloring amongst the original Scottish Aberdeen Angus population. If a color is not specified when referring to Angus cattle, it\'s presumed to be black.\r\n\r\n<a href="http://en.wikipedia.org/wiki/Red_Angus">Red Angus</a>, a breed resulting from the selection of red individuals from the Angus population, which has always had both red and black individuals.\r\n\r\n<hr />\r\n\r\n<h3>Domestic and Australian Kobe Style</h3>\r\nKobe beef is known worldwide for its marbling characteristics, naturally enhanced flavor, tenderness and juiciness. It is also known for its high market value.\r\n\r\nDomestic and Australian Kobe style is imported Japanese Kobe Wagyu cattle crossbred with Angus cattle to span and survive US climate. It is fed a special grain, mimicking Japanese feed of corn, alfalfa, barley and wheat-straw for a minimum of 350 days. Extended feed time and special grain, contribute to the high fat marbling in this beef.', 'Beef', '', 'inherit', 'closed', 'closed', '', '31-revision-v1', '', '', '2016-01-12 14:34:28', '2016-01-12 22:34:28', '', 31, 'http://rockerbrosmeat.com/2016/01/12/31-revision-v1/', 0, 'revision', '', 0),
(200, 1, '2016-01-12 14:36:25', '2016-01-12 22:36:25', 'USDA Prime and Choice truly natural, never-ever (no antibiotics or hormones given - EVER) cattle raised in Colorado, with Certified Humane verification.\r\n\r\n<a href="http://aspenridgebeef.com/" target="_blank">Click here to visit Aspen Ridge Website &gt;</a>', 'Beef Suppliers', '', 'inherit', 'closed', 'closed', '', '196-revision-v1', '', '', '2016-01-12 14:36:25', '2016-01-12 22:36:25', '', 196, 'http://rockerbrosmeat.com/2016/01/12/196-revision-v1/', 0, 'revision', '', 0),
(201, 1, '2016-01-14 12:40:06', '2016-01-14 20:40:06', '<h2>Our History</h2>\r\nRocker Bros. Meats &amp; Provisions, Inc. is a family operated business with a combined 100-years-plus of meat buying, processing, and distributing experience. Our father started Holiday Meat &amp; Provisions in 1965 and the torch has now been passed to Shelly and David, who operate Rocker Bros. Meat &amp; Provisions with the same old-fashioned values, plus a whole new set of working dynamics for higher quality, greater efficiency and better customer satisfaction.\r\n\r\n<strong>Customer Satisfaction is goal number 1:</strong>\r\n\r\nIt is our job, and our goal, to provide chefs with meat products that make their dishes delicious and profitable. We consider ourselves partners with our restaurant owners and chefs. We are the personal, custom butcher shop that every cooking professional needs. We provide cut and cooking suggestions, professional yield testing, premium buying services, and customized processing, like dry aging, trimming and portioning specific to our chef’s wishes.\r\n\r\nOur Midwest suppliers provide us with the finest USDA primal cuts, which we age and process to your exact specifications. We operate under USDA Establishment 1160 and follow strict USDA HACCP regulations. We feature a full line of all meat products, including beef, pork, lamb, veal, poultry, and fresh seafood.\r\n\r\nWe are proud of our high-quality product lines and exclusive relationships with companies such as Sonoma Direct for whom we distribute pasture-raised lamb, pork and other delicious meats that are raised on sustainable family farms.\r\n\r\nAt Rocker Bros, our specialty is portion control. Our butchers are the finest in the meat industry, and some of them have been with us for over 30 years. Their cutting is precise, and we are regularly creating, with our chefs, cuts uniquely designed for their menus. Kobe-style steaks, bone-in filets, beef and lamb short rib osso-buco (Volcano), prime, dry aged cross-cut new york steaks, and prime rib eye medallions, are a few examples.\r\n\r\nWe work really hard to supply our customers with the highest quality meat products at the most affordable prices. Our customers are pleasantly surprised when they realize that often they can buy USDA Prime beef at USDA Choice beef prices.\r\n\r\nWe will come to you and design a program that will enhance your menu with new, innovative products, and prices that will make you (and your customers) very happy. And we invite you to come and take a tour of Rocker Bros unique " boutique" meat environment. Walk through the dry age room, discover and sample new items, and let us customize a meat program just for you.\r\n\r\n<hr />\r\n\r\n<h3>Sheldon Rocker</h3>\r\nProprietor\r\n\r\n<a class="btn" href="http://rockerbrosmeat.com/about-us/sheldon-rocker/">Full Bio →</a>', 'About Us', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2016-01-14 12:40:06', '2016-01-14 20:40:06', '', 7, 'http://rockerbrosmeat.com/2016/01/14/7-revision-v1/', 0, 'revision', '', 0),
(203, 1, '2016-01-29 13:08:30', '2016-01-29 21:08:30', 'We not only provide you with any cut of pork, from whole loins to rack chops, but we carry pork products from a variety of specialty pork vendors to satisfy every request.\r\n\r\n<strong>IBP</strong> – their fine quality Mid-Western pork program provides us with the most consistently flavorful and reasonably priced pork cuts.\r\n\r\n<strong>Prime Pork</strong> – a flavor sensation at an unbeatable price. Prime pork comes from an Iowa based provider, and their unique program is a reasonably priced substitute for some of the more expensive pork products like Kurobuta.\r\n\r\n<strong>Kurobuta</strong> – Berkshire pork is called Kurobuta (Black Hog) in Japan. Darker looking than standard pork, Kurobuta is known for it’s good marbling, richer taste, and is never injected with brine water (seasoning) as some pork is.\r\n\r\n<strong>Good Nature Pork</strong> is free of antibiotics, growth stimulants and preservatives - animals are raised on a 100% vegetarian diet on farms in the Midwest, where farmers adhere to stringent animal health and humane treatment practices.\r\n\r\n<strong>Beelers Pork</strong> Duroc breed pigs raised humanely, compassionately, naturally.\r\n\r\n&nbsp;', 'Pork', '', 'inherit', 'closed', 'closed', '', '33-revision-v1', '', '', '2016-01-29 13:08:30', '2016-01-29 21:08:30', '', 33, 'http://rockerbrosmeat.com/2016/01/29/33-revision-v1/', 0, 'revision', '', 0),
(204, 1, '2016-01-29 13:09:47', '2016-01-29 21:09:47', '<h2></h2>\r\n<h2>Rocker Bros Delivers..</h2>\r\nYour meats are delivered in refrigerated vans six days a week. Saturday deliveries are no extra charge, and though we have no minimum delivery fee, we do ask that our customers consider the environment when ordering - fewer deliveries means less waste, greater efficiency, and savings to all.', 'Deliveries', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2016-01-29 13:09:47', '2016-01-29 21:09:47', '', 11, 'http://rockerbrosmeat.com/2016/01/29/11-revision-v1/', 0, 'revision', '', 0),
