(238, 1, '2016-02-02 13:23:22', '2016-02-02 21:23:22', 'USDA Prime and Choice truly natural, never-ever (no antibiotics or hormones given - EVER) cattle raised in Colorado, with Certified Humane verification.\r\n\r\n<a href="http://aspenridgebeef.com/"><img class="alignnone wp-image-226 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/aspen-ridge-logo-200x200.png" alt="aspen-ridge-logo" width="200" height="200" /></a>\r\n\r\n<a href="http://aspenridgebeef.com/" target="_blank">Click here to visit Aspen Ridge Website &gt;</a>', 'Beef Suppliers', '', 'inherit', 'closed', 'closed', '', '196-revision-v1', '', '', '2016-02-02 13:23:22', '2016-02-02 21:23:22', '', 196, 'http://rockerbrosmeat.com/2016/02/02/196-revision-v1/', 0, 'revision', '', 0),
(239, 1, '2016-02-02 13:24:23', '2016-02-02 21:24:23', 'We not only provide you with any cut of pork, from whole loins to rack chops, but we carry pork products from a variety of specialty pork vendors to satisfy every request.\r\n\r\n<strong>IBP</strong> – their fine quality Mid-Western pork program provides us with the most consistently flavorful and reasonably priced pork cuts.\r\n\r\n<strong>Prime Pork</strong> – a flavor sensation at an unbeatable price. Prime pork comes from an Iowa based provider, and their unique program is a reasonably priced substitute for some of the more expensive pork products like Kurobuta.\r\n\r\n<strong>Kurobuta</strong> – Berkshire pork is called Kurobuta (Black Hog) in Japan. Darker looking than standard pork, Kurobuta is known for it’s good marbling, richer taste, and is never injected with brine water (seasoning) as some pork is.\r\n\r\n<strong>Good Nature Pork</strong> is free of antibiotics, growth stimulants and preservatives - animals are raised on a 100% vegetarian diet on farms in the Midwest, where farmers adhere to stringent animal health and humane treatment practices.\r\n\r\n<strong>Beelers Pork</strong> Duroc breed pigs raised humanely, compassionately, naturally.\r\n\r\n<a href="http://www.beelerspurepork.com/"><img class="alignnone wp-image-227 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/beelers-logo-200x200.png" alt="beelers-logo" width="200" height="200" /></a>\r\n\r\n&nbsp;', 'Pork', '', 'inherit', 'closed', 'closed', '', '33-revision-v1', '', '', '2016-02-02 13:24:23', '2016-02-02 21:24:23', '', 33, 'http://rockerbrosmeat.com/2016/02/02/33-revision-v1/', 0, 'revision', '', 0),
(240, 1, '2016-02-02 13:25:26', '2016-02-02 21:25:26', '<strong>Superior Farms Lamb:</strong> One of our fine lamb suppliers, Superior provides us with well-known, fine tasting, Colorado Lamb and we make this available to you in primal cuts or by whole animal.\r\n\r\n<strong>Superior Pure –</strong> Lamb raised by Superior Farms on their Superior Pure program are all raised naturally, on family farms in America. This lamb is also available in cuts or by whole animal.\r\n\r\n<strong>Australian –</strong> we offer Australian lamb products, which come in various sizes, including large 28 up lamb racks. Our Australian product is well priced, and delivered cap off, ready to cut and serve.\r\n\r\n<strong>New Zealand –</strong> We keep a variety of sizes of New Zealand lamb in stock, from 10 – 12 oz to 24 oz and up. Lamb from New Zealand is quite nice and extremely well priced.\r\n\r\n<a href="http://superiorfarms.com/"><img class="alignnone wp-image-237 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/superior-farms-logo-200x200.png" alt="superior-farms-logo" width="200" height="200" /></a>', 'Lamb', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2016-02-02 13:25:26', '2016-02-02 21:25:26', '', 35, 'http://rockerbrosmeat.com/2016/02/02/35-revision-v1/', 0, 'revision', '', 0) ;
