0.png" alt="butterball-logo" width="200" height="200" /></a> <a href="http://www.eatlikeitmatters.com/"><img class="alignnone wp-image-228 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/bn-ranch-logo-200x200.png" alt="bn-ranch-logo" width="200" height="200" /></a>\r\n\r\n&nbsp;\r\n\r\n<hr />\r\n\r\n<h2>Duck:</h2>\r\nWe carry Muscovy, Pekin Long Island, and Maple Leaf brands duck and duck breast. We also have fresh Woodland Duck from Northern CA and fresh Muscovy from Grimaud Farms in Sonoma CA.', 'Poultry', '', 'inherit', 'closed', 'closed', '', '39-revision-v1', '', '', '2016-02-02 13:29:47', '2016-02-02 21:29:47', '', 39, 'http://rockerbrosmeat.com/2016/02/02/39-revision-v1/', 0, 'revision', '', 0),
(243, 1, '2016-02-02 13:32:57', '2016-02-02 21:32:57', '<strong>Hormel –</strong> we are a direct distributor for all Hormel Brands. They have some of the finest bacon you can buy.\n\n<strong>North Country Smokehouse –</strong> We exclusively distribute the North Country Smokehouse products in Los Angeles. Their artisanal smoked meats are some of the finest we have tasted and they offer, among other things, a line of all natural, nitrite free smoked products.\n\n<strong>Daily’s Bacon –</strong> our house brand, delicious and reasonably priced. We carry thick and thinly sliced, regular and applewood smoke in slab or sliced\n\n<a href="https://ncsmokehouse.com/"><img class="alignnone wp-image-235 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/north-country-logo-200x200.png" alt="north-country-logo" width="200" height="200" /></a> <a href="http://www.hormel.com/"><img class="alignnone wp-image-232 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/hormel-logo-200x200.png" alt="hormel-logo" width="200" height="200" /></a> <a href="http://dailysmeats.seaboardfoods.com/"><img class="alignnone wp-image-230 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/dailys-logo-200x200.png" alt="dailys-logo" width="200" height="200" /></a>\n\n<hr />\n\n<h2>We also carry:</h2>\n<strong>Russak\'s –</strong> One if the finest company’s selling cured and smoked products, we proudly sell the Russak’s brand roast beef, corned beef, pastrami, and more.\n\n<strong>Jodi Maroni Sausages –</strong> A real crowd-pleaser, we carry the Jodi Maroni raw and cooked sausages in various flavor profiles.\n\n<strong>Specialy Sausages –</strong> Ask about our specialty sausages from different countries – we carry some of the finest, and most unusual sausages you can find.\n\n<a href="http://p3nlhclust404.shr.prod.phx3.secureserver.net/SharedContent/redirect_0.html"><img class="alignnone wp-image-236 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/russaks-logo-200x200.png" alt="russaks-logo" width="200" height="200" /></a> <img class="alignnone size-medium wp-image-233" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/jody-maronis-logo-200x200.png" alt="jody-maronis-logo" width="200" height="200" />', 'Smoked Meat', '', 'inherit', 'closed', 'closed', '', '41-autosave-v1', '', '', '2016-02-02 13:32:57', '2016-02-02 21:32:57', '', 41, 'http://rockerbrosmeat.com/2016/02/02/41-autosave-v1/', 0, 'revision', '', 0),
