(247, 1, '2016-02-05 11:25:53', '2016-02-05 19:25:53', '', 'countryside and small village at sunset in rural Montana', '', 'inherit', 'closed', 'closed', '', 'countryside-and-small-village-at-sunset-in-rural-montana', '', '', '2016-02-05 11:25:53', '2016-02-05 19:25:53', '', 0, 'http://rockerbrosmeat.com/wp-content/uploads/2016/02/green-healthy-human.jpg', 0, 'attachment', 'image/jpeg', 0),
(248, 1, '2016-02-12 13:04:35', '2016-02-12 21:04:35', 'We not only provide you with any cut of pork, from whole loins to rack chops, but we carry pork products from a variety of specialty pork vendors to satisfy every request.\n\n&nbsp;\n\n<strong>IBP</strong> – their fine quality Mid-Western pork program provides us with the most consistently flavorful and reasonably priced pork cuts.\n\n<strong>Prime Pork</strong> – a flavor sensation at an unbeatable price. Prime pork comes from an Iowa based provider, and their unique program is a reasonably priced substitute for some of the more expensive pork products like Kurobuta.\n\n<strong>Kurobuta</strong> – Berkshire pork is called Kurobuta (Black Hog) in Japan. Darker looking than standard pork, Kurobuta is known for it’s good marbling, richer taste, and is never injected with brine water (seasoning) as some pork is.\n\n<strong>Good Nature Pork</strong> is free of antibiotics, growth stimulants and preservatives - animals are raised on a 100% vegetarian diet on farms in the Midwest, where farmers adhere to stringent animal health and humane treatment practices.\n\n<strong>Beelers Pork</strong> Duroc breed pigs raised humanely, compassionately, naturally.\n\n<a href="http://www.beelerspurepork.com/"><img class="alignnone wp-image-227 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/beelers-logo-200x200.png" alt="beelers-logo" width="200" height="200" /></a>\n\n&nbsp;', 'Pork', '', 'inherit', 'closed', 'closed', '', '33-autosave-v1', '', '', '2016-02-12 13:04:35', '2016-02-12 21:04:35', '', 33, 'http://rockerbrosmeat.com/2016/02/12/33-autosave-v1/', 0, 'revision', '', 0),
(249, 1, '2016-02-12 13:04:56', '2016-02-12 21:04:56', 'We not only provide you with any cut of pork, from whole loins to rack chops, but we carry pork products from a variety of specialty pork vendors to satisfy every request.\r\n\r\n<strong>Stone Valley Farms</strong> - We offer Stone Valley Farms Heritage pork, these hogs are raised in Central California and are raised in open air, deep bedded barns. Humanely raised hormone and antibiotic free and of course, no animal proteins or animal by-products are ever used. 50% Berkshire, 25% Yorkshire and 25% Duroc make up the genetics and the hogs are finished on barley to achieve velvety texture and pure white fat.\r\n\r\n<strong>IBP</strong> – their fine quality Mid-Western pork program provides us with the most consistently flavorful and reasonably priced pork cuts.\r\n\r\n<strong>Prime Pork</strong> – a flavor sensation at an unbeatable price. Prime pork comes from an Iowa based provider, and their unique program is a reasonably priced substitute for some of the more expensive pork products like Kurobuta.\r\n\r\n<strong>Kurobuta</strong> – Berkshire pork is called Kurobuta (Black Hog) in Japan. Darker looking than standard pork, Kurobuta is known for it’s good marbling, richer taste, and is never injected with brine water (seasoning) as some pork is.\r\n\r\n<strong>Good Nature Pork</strong> is free of antibiotics, growth stimulants and preservatives - animals are raised on a 100% vegetarian diet on farms in the Midwest, where farmers adhere to stringent animal health and humane treatment practices.\r\n\r\n<strong>Beelers Pork</strong> Duroc breed pigs raised humanely, compassionately, naturally.\r\n\r\n<a href="http://www.beelerspurepork.com/"><img class="alignnone wp-image-227 size-medium" src="http://rockerbrosmeat.com/wp-content/uploads/2016/02/beelers-logo-200x200.png" alt="beelers-logo" width="200" height="200" /></a>\r\n\r\n&nbsp;', 'Pork', '', 'inherit', 'closed', 'closed', '', '33-revision-v1', '', '', '2016-02-12 13:04:56', '2016-02-12 21:04:56', '', 33, 'http://rockerbrosmeat.com/2016/02/12/33-revision-v1/', 0, 'revision', '', 0),
