INSERT INTO `wp_rg_lead_detail` ( `id`, `lead_id`, `form_id`, `field_number`, `value`) VALUES
(1, 1, 1, '1.3', 'Lara'),
(2, 1, 1, '1.6', 'MacIsaac'),
(3, 1, 1, '2', 'laramac_333@yahoo.com'),
(4, 1, 1, '3', '(626) 755-8331'),
(5, 1, 1, '5', 'Traveler Cafe'),
(6, 1, 1, '7', 'I am opening a new cafe in Ventura. We are set to open March 1st. I would like to request a price list of your products.\r\nThank you'),
(7, 2, 1, '1.3', 'Darryl'),
(8, 2, 1, '1.6', 'Kwok'),
(9, 2, 1, '2', 'darrylkwok@yahoo.com'),
(10, 2, 1, '3', '(714) 651-4672'),
(11, 2, 1, '5', 'Cleverl Leaf Inc.'),
(12, 2, 1, '7', 'Hi,\r\n\r\nWe will be opening a full service Chinese restaurant and are currently looking for suppliers. Would it be possible to get a product and price list or do we need to fill out the credit application first. Thank you.\r\n\r\nDarryl Kwok'),
(13, 3, 1, '1.3', 'Rene'),
(14, 3, 1, '1.6', 'Quibuyen'),
(15, 3, 1, '2', 'EatEmazing@Gmail.com'),
(16, 3, 1, '3', '(714) 841-8220'),
(17, 3, 1, '5', 'Emazing Meals, LLC'),
(18, 3, 1, '7', 'Hello Rocker Bros,\r\n\r\nI would like to inquire about a few items.\r\n\r\nPrice for Sirloin Flap Meat\r\n\r\nGround Beef 93/7 or 90/10\r\n\r\nGround Turkey 90/10\r\n\r\nPorkLoin Boneless Fresh\r\n\r\nChicken Breast Random and Same Size\r\n\r\nAnd other steaks you guys carry.\r\n\r\nThank you'),
(19, 4, 1, '1.3', 'Dean'),
(20, 4, 1, '1.6', 'Cotton'),
(21, 4, 1, '2', 'dcotton@alf-inc.com'),
(22, 4, 1, '3', '(253) 479-0125'),
(23, 4, 1, '5', 'Air-Land Forwarding - final communication'),
(24, 4, 1, '7', 'Hello! – would you please forward this note to your logistics/transportation dept. Thank you.\r\nI wanted to make one last effort to contact you and see if we can help support your organization re: carrier services. \r\nWe are a specialty Western Region carrier in that we transport fresh/chilled/frozen perishables as well as all types of dry products. We have been in business over 20 years servicing the following areas:\r\nAll of WA state (hub in Kent WA)/Western OR (Portland & vicinity - hub in Oregon City)/Northern & Southern CA (hub in Los Angeles)/Boise ID & vicinity/Salt Lake City UT & vicinity and Denver CO & vicinity. Please let me know where else outside of these areas you might be interested in, as we also are building lanes in the Phoenix and Las Vegas areas. \r\nFor your reference, our website is www.alf-inc.com \r\nIf there is anything we can assist you with, please let me know.\r\nThank you,\r\n\r\nDean Cotton\r\nDirector, Sales & Mktg.\r\nALF'),
(25, 5, 1, '1.3', 'Sneh Lata'),
(26, 5, 1, '1.6', 'Gumidelli'),
(27, 5, 1, '2', 'zafranpot@gmail.com'),
(28, 5, 1, '3', '(310) 733-7515'),
(29, 5, 1, '5', 'Zafranpot (upcoming restaurant)'),
(30, 5, 1, '7', 'Hi,\r\n\r\nI am looking for organic poultry and some regular lamb meat for my restaurant, please could you provide the prices. Also how can i apply to be a member. I had contacted you by phone but no sales called me back.\r\n\r\nthe address of the restaurant, we are taking over this place on May 15th\r\n10408 Venice blvd\r\nCulver city Ca 90232 \r\n\r\nThanks  Sneh'),
(31, 6, 1, '1.3', 'Gustav'),
(32, 6, 1, '1.6', 'Nipe'),
(33, 6, 1, '2', 'gustav.nipe@singularityu.org'),
(34, 6, 1, '3', '(650) 443-8183'),
(35, 6, 1, '5', 'Team ImpactVision'),
(36, 6, 1, '7', 'Hi Rocker Bros Meat & Provision,\r\n\r\nMy name is Gustav Nipe and I study at Singularity University, located at NASA Ames Research Park in Mountain View.\r\n\r\nMe and my colleague are working on a machine vision system that can predict pH-level and tenderness of beef meat in a rapid and non destructive way.\r\n\r\nIt would be really interesting for us to talk with someone at Rocker Bros Meat & Provision who can answer questions about how you measure the quality of beef meat today?\r\n\r\nBest regards,\r\nGustav Nipe\r\n\r\nPhone: 6504438183'),
(37, 7, 1, '1.3', 'jenny'),
(38, 7, 1, '1.6', 'william'),
(39, 7, 1, '2', 'jennyseomarketing010@gmail.com'),
(40, 7, 1, '3', '(565) 656-5665'),
(41, 7, 1, '5', 'Seo Tech'),
(42, 7, 1, '7', 'Google Traffic Decreased\r\n\r\nHi,\r\nHope you are doing well.\r\nMy name is jenny william, SEO expert of a Leading SEO service provider company. As per my analysis, your website is not performing well in the Google organic search as well as your traffic / visitor is poor from the last couple of months due to some of the reasons. \r\nYou might know about the frequent Google updates and as per the latest update, Google has completely dropped all authorship functionality from the search results and webmaster tools. So be careful with it and take the help of an SEO company to fix it.\r\n\r\nSome of the aspects are given below:\r\n\r\n1.  Your back links are not good enough, which affects link popularity.\r\n\r\n2.  Some of the competitive Keywords are not on the first page of Google, Yahoo and Bing, which affects visibility.\r\n\r\n3.  Errors and issues found in your website.\r\n\r\n4.  Good Blogs, Articles and Press Release are not found for your website.\r\n\r\n5.  Your website overall SEO score affected due to no online promotion.\r\n\r\n6.  Your website generates less traffic as compare to your competitor. \r\n\r\nArea of Improvement:\r\n\r\n1.      We will give you 1st page ranking on Google, Yahoo, and Bing.\r\n\r\n2.      Improve your sales and brand value.\r\n\r\n3.      We will recover from the recent Panda 4.2 Google updates.\r\n\r\n4.      We will provide you high quality Blogs, Articles and Press Release for your website.\r\n\r\n5.      Increase your traffic flow.\r\n\r\n6.      Target your local as well as global market to increase business.\r\n\r\nWe will be optimizing your website in the major search engines like: Google, Yahoo & Bing, which results in improvements in keyword ranking, traffic, link popularity, goal conversion, and ROI from the first month.\r\nPlease reply back to get the “Company profile”, “Service details”, “Pricing”, “Client testimonial” “Proposal”, Free Website Audit Report.\r\n\r\nThanks\r\njennyseomarketing010@gmail.com'),
(43, 8, 1, '1.3', 'cedric'),
(44, 8, 1, '1.6', 'nicolas'),
(45, 8, 1, '2', 'cedric.nicolas@live.fr'),
(46, 8, 1, '3', '(310) 382-7995'),
(47, 8, 1, '5', 'belle vie restaurant'),
(48, 8, 1, '7', 'hello\r\nwe are opening a restaurant in santa monica in 2 weeks and a friend chef of mine talk to me about your companie\r\nso i would like to meet you as soon as possible\r\nthak you very much'),
(49, 9, 1, '1.3', 'Sara'),
