(59, 10, 1, '5', 'Rw Zant'),
(60, 10, 1, '7', 'Hello im in looking for any job openings available In your company. I worked at Rw Zant for 10years and i have all the experience from receptionist, cashier,order entry,customer service, and sales cordinator. I hope to hear from you guys soon.\r\nThank you,\r\nClaudia Ramirez'),
