(65, 11, 1, '5', 'Acme Hospitality'),
(66, 11, 1, '7', 'Hello,\r\n\r\nI\'ve been trying to get a rep out here to talk about a new restaurant I\'m opening in August.\r\n\r\nHis name is Christian and we spoke on the phone a couple weeks ago and haven\'t heard from him since.\r\n\r\nJust wanted to see what was going on and if I could meet somebody and/or get some pricing information.\r\n\r\nThanks.'),
(67, 12, 1, '1.3', 'Peter'),
(68, 12, 1, '1.6', 'Smith'),
(69, 12, 1, '2', 'peter.fastmerchant@gmail.com'),
(70, 12, 1, '3', '(412) 894-8880'),
(71, 12, 1, '5', 'Rocker Brothers Meat &amp; Provision'),
(72, 12, 1, '7', 'UNSECURED > NO COLLATERAL REQUIRED > Expedited Closing > No Business Plan Needed > No Upfront Fees > We are a single source of capital for business need, working capital, business expansion, equipment purchase for your business or if you want to add another location for your business or any other use and unexpected capital needs...."We help American small businesses succeed!". Please call1-412-894-8880 now or send an email.'),
(73, 13, 1, '1.3', 'Vic'),
(74, 13, 1, '1.6', 'Gerami'),
(75, 13, 1, '2', 'vgerami@laweekly.com'),
(76, 13, 1, '3', '(310) 574-7349'),
(77, 13, 1, '5', 'LA WEEKLY'),
(78, 13, 1, '7', 'Hello,\r\n\r\nOn behalf of LA Weekly, I’d like to talk to you about sponsoring our signature event,” Burgers & Beer”, on Saturday July 30th at the Los Angeles Memorial Coliseum, home of Los Angeles RAMS.  \r\n\r\nLA Weekly’s 2nd Annual Craft Beer and Artisanal Burger Extravaganza is curated by our food editor Garrett Snyder and beer expert Sarah Bennett. Along with great food, there’ll be live music curated by Spaceland Productions.\r\n\r\nMuch like our other events, we anticipate to sell out 2,500 tickets.  Presenting Sponsor as well as various categories of sponsorship are still open.  Please see attached sponsorship deck and note that we can design a custom package to match your needs and initiatives.  Also, you’re welcome to sell products there as part of your activation. \r\n\r\nI’d like to hear your thoughts and feedback so let me know if you have any questions.  Perhaps we can jump on a quick call and discuss.   I realize that you might not handle sponsorship matters, so please kindly forward this to the appropriate individual. \r\n\r\nPlease check out below link for event micro site and current sponsors: \r\nhttp://microapp.laweekly.com/burgersandbeer/2016/\r\n\r\nLA Weekly’s 4th annual Tacolandia took place last weekend. 9,000 attendees, 150 taco vendors and 40 media outlets made it a smashing success.  And here we have our first photos from our editorial slideshow!\r\n\r\nhttp://www.laweekly.com/slideshow/la-weeklys-tacolandia-2016-is-taco-heaven-on-earth-7027789\r\n\r\nAsk me about having a RAM’s suite as part of your sponsorship.  Please let me know if I should be contacting someone else instead as I appreciate it very much.'),
(79, 14, 1, '1.3', 'Ashley'),
(80, 14, 1, '1.6', 'Abodeely'),
(81, 14, 1, '2', 'aabodeely@thenomadhotel.com'),
(82, 14, 1, '3', '(603) 305-3400'),
(83, 14, 1, '5', 'The Nomad Hotel NYC'),
