(106, 18, 1, '7', 'Hello, \r\nThis is Jesus Garcia from Diazteca Sea Salt Division. \r\nWe offering high quality Sea Salt in 50 pounds bags. \r\nIf you need a further information, I leave my email and telephone.\r\n520 281 4281 ext. 501 \r\njesus.garcia@diazteca.com \r\nThanks and have a great day'),
